(2, 'WELCOME E-MAIL', 'Seller', 'info@shopking24.com', 'Shopking24', 'Congratulation {FIRST_NAME} {LAST_NAME}', '<p>Congratulation....</p>\n\n<p>Dear. {FIRST_NAME} {LAST_NAME}.</p>\n\n<p><strong>{LINK}</strong></p>\n', '#235daa', '<strong>{FIRST_NAME}</strong><br>\n<strong>{LAST_NAME}</strong><br>\n<strong>{LINK}</strong>'),
