(4, 'FORGOT PASSWORD', 'Seller', 'info@shopking24.com', 'Shopking24', 'Shopking24 Authontication Information', '<p>Congratulation....</p>\n\n<p>Dear.<strong>{BUSINESS_NAME}</strong></p>\n\n<p>Your User Id :&nbsp;<strong>{USER_ID}</strong></p>\n\n<p>Your Password :&nbsp;<strong>{PASSWORD}</strong></p>\n', '#45c29d', '<strong>{BUSINESS_NAME}</strong><br>\n<strong>{USER_ID}</strong><br>\n<strong>{PASSWORD}</strong>'),
(5, 'ORDER PLACED', 'Buyer', 'info@shopking24.com', 'Shopking24', 'Congratulation {FIRST_NAME} {LAST_NAME}', '<p>Congratulation....</p>\r\n\r\n<p>Dear. {FIRST_NAME} {LAST_NAME}.</p>\r\n\r\n<p>Your Order Product Details</p>\r\n\r\n<p>{PRODUCT_DETAILS}</p>\r\n', '#f6ba78', '<strong>{FIRST_NAME}</strong><br><strong>{LAST_NAME}</strong><br><strong>{PRODUCT_DETAILS}</strong>'),
(6, 'NEW ORDER', 'Seller', 'info@shopking24.com', 'Shopking24', 'Congratulation {BUSINESS_NAME}', '<p>Congratulation....</p>\n\n<p>Dear. {BUSINESS_NAME} .</p>\n\n<p>Your New Order Product Details</p>\n\n<p>{PRODUCT_DETAILS}</p>\n', '#f6ba78', '<strong>{BUSINESS_NAME}</strong><br><strong>{PRODUCT_DETAILS}</strong>'),
(7, 'ORDER CANCELLED', 'Seller', 'info@shopking24.com', 'Shopking24', 'Order Cancelled for {BUSINESS_NAME}', '<p>Order Cancelled ....</p>\n\n<p>Dear. {BUSINESS_NAME} .</p>\n\n<p>Your Order Cancelation Request For Order Id : {ORDER_ID} Is Completed.</p>\n\n<p>Your Order Product Details</p>\n\n<p><strong>{PRODUCT_DETAILS}</strong></p>\n', '#d5171d', '<strong>{BUSINESS_NAME}</strong><br><strong>{ORDER_ID}</strong><br><strong>{PRODUCT_DETAILS}</strong>'),
