(9, 'FORGOT PASSWORD', 'Employee', 'info@shopking24.com', 'Shopking24', 'Shopking24 Authontication Information', '<p>Congratulation....</p>\n\n<p>Dear.<strong>{FIRST_NAME} {LAST_NAME}</strong></p>\n\n<p>Your User Id :&nbsp;<strong>{USER_ID}</strong></p>\n\n<p>Your Password :&nbsp;<strong>{PASSWORD}</strong></p>\n', '#f6ba78', '<strong>{FIRST_NAME}</strong><br>\r\n<strong>{LAST_NAME}</strong><br>\r\n<strong>{USER_ID}</strong><br>\r\n<strong>{PASSWORD}</strong>'),
