(11, 'REFUND E-MAIL', 'Buyer', 'notification@flipkart.com', 'Flipkart', 'Congratulation {FIRST_NAME} {LAST_NAME}', '<p>Congratulation....</p>\r\n\r\n<p>Mr./Mrs. {FIRST_NAME} {LAST_NAME}.</p>\r\n\r\n<p>We Successfully Refund Amount : {AMOUNT}&nbsp;To Your Respective Account.</p>\r\n', '#235daa', '<strong>{FIRST_NAME}</strong><br>\r\n<strong>{LAST_NAME}</strong><br>\r\n<strong>{AMOUNT}</strong>');
