INSERT INTO `pages` (`page_id`, `title`, `name`, `url`, `content`) VALUES
(1, 'About Us', 'about-us', 'http://localhost/flipkart/about-us', '<p>About Us</p>\r\n'),
(2, 'Contact Us', 'contact-us', 'http://localhost/flipkart/contact-us', '<p><span style="font-size:16px"><strong>Exchange/Returns</strong></span></p>\n\n<p>In case you want to track your return, please go to your order page and get all information.</p>\n\n<p><span style="font-size:16px"><strong>Customer care</strong></span></p>\n\n<p>Want to know about order status or queries related to a product give us a call or drop a line</p>\n\n<p><strong>Phone number</strong>: 0261-1111111 ; <strong>Email</strong> :-&nbsp; support@shopking24.com</p>\n\n<p>shopking24 Complaint Resolution</p>\n\n<p>Our issue resolution process is designed to encourage the fast and efficient resolution of your issue at the first point of contact. While we always aim to provide you with awesome customer service, we recognize that you may wish to express dissatisfaction with our products, services, staff or policies.</p>\n\n<p><span style="font-size:16px"><strong>Other Enquiries</strong></span></p>\n\n<p><strong>Corporate Sales</strong>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;:-&nbsp; corporate.sales@shopking24.com</p>\n\n<p><strong>Business Development &amp; Partnerships</strong>&nbsp;&nbsp;&nbsp;&nbsp; :-&nbsp;&nbsp;partners@shopking24.com</p>\n'),
(3, 'Shipping', 'shipping', 'http://localhost/flipkart/shipping', '<p style="text-align:center"><span style="font-size:18px"><strong>SHIPPING POLICY</strong></span></p>\n\n<p><strong>Where all do we deliver:</strong></p>\n\n<p>shopking24.com provides free shipping to our valuable customers.</p>\n\n<p>We deliver to all and any postal address around all over india. However, Courier companies do not deliver to P.O.Box address, so we request you to provide full street address with pin code / zip code.</p>\n\n<p>Please note that there are no shipments made from the store on Sundays and public holidays as our logistics partners, do not make any pick-ups on those days.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Shipping gifts to India</strong></p>\n\n<p>We take great pride in being able to offer all over INDIA SHIPPING to any address in India to our customers with family and friends back home. To ensure the quickest confirmed delivery on all orders to India, please be sure to include the COMPLETE postal address with the correct PIN CODE. We cannot be responsible for postal delays resulting from incomplete address listings.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Transit times</strong></p>\n\n<p>We ship all orders by fastest possible air courier services like Fedex DTDC , UPS and they deliver within 5-6 working days across india.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Address change requests:</strong></p>\n\n<p>Once an order is registered, you cannot make any alterations. However, address alteration requests may be accommodated within 24 hours of placing the order. You may send your alteration request to&nbsp; info@shopking24.com</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Shipment and tracking details:</strong></p>\n\n<p>We will send you an email regarding the shipment of your order, as soon as the items are handed over to the Courier. These alert emails will contain the tracking number and courier companies website details along with expected date of delivery. you may also check the same on our order status page.</p>\n\n<p>Tracking numbers for orders shipped might take 24 business hours to become active on the courier websites.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>What happens if my order is lost in transit?</strong></p>\n\n<p>If a shipment is lost in transit, we wait for 15 days and then reprocess/reship the order.</p>\n\n<p>If you have any question about our shipping policies, please email us at <strong>support@shopking24.com</strong></p>\n'),
(4, 'Cancellation & Return', 'cancellation-and-return', 'http://localhost/flipkart/cancellation-and-return', NULL),
(5, 'Payment Method', 'payment-method', 'http://localhost/flipkart/payment-method', '<p><span style="font-size:16px"><strong>Secure Payment Options</strong></span></p>\n\n<p><span style="font-size:16px"><strong>Is it safe to use my credit card?</strong></span></p>\n\n<p>Yes, shopping at Shopking24.com is 100% safe. We currently have two payment gateways to choose from: EBS and CCavenue. Both payment gateways are secure and provide mulitple options to pay.</p>\n\n<p>EBS and CCavenue both uses the latest encryption technology to protect your credit card information. It encrypts your credit card number so that it cannot be read as the information travels over the Internet. Furthermore, both EBS and CCavenue also asks you to enter the CVV (Credit Verification Value) number on your credit card. This is a 3 digit number which follows your credit card number and is given at the back of the card to ensure that the person entering the card number has the physical plastic card with him/her.</p>\n\n<p>You can be assured that Shopking24.com offers you the highest standards of security currently available on the net so as to ensure that your shopping experience is private, safe and secure.</p>\n\n<p><span style="font-size:16px"><strong>Does Shopking24.com store my credit card infomation?</strong></span></p>\n\n<p>Shopking24.com does not collect or store your account information at all. Your transaction is authorized at multiple points, first by EBS/CCavenue and subsequently by Visa/Mastercard/Amex/Diners secure directly without any information passing through us.</p>\n\n<p>Do you accept international credit cards on Shopking24?</p>\n\n<p>Our overseas customers and Non Resident Indians can use their International credit cards to make payments for their orders. We accept all international credit cards.</p>\n\n<p>What credit cards are supported?</p>\n\n<p>We accept all MasterCard, Visa, Amex, JCB and Diners credit cards.</p>\n\n<p>What are Net Banking and Debit Card options you have?</p>\n\n<p>All Banking Debit Cards &amp; Netbanking.</p>\n\n<p>Internet Banking</p>\n\n<p>We accept payment all banking through Internet Banking</p>\n\n<p><strong>AND YOU CAN GET PRODUCT&nbsp; CASH ON DELIVERY WITH OUT ANY EXTRA CHARGE</strong></p>\n'),
(6, 'Seller FAQ', 'seller-faq', 'http://localhost/flipkart/seller-faq', '<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>Dear Sellers of shopking24,</strong></span></p>\n\n<p>We get lot of queries from Sellers most of which are very common. Below are some Most Frequently Asked Questions (FAQs) which may help you get more clarity on Selling on shopking24.com:</p>\n\n<p><strong>1. When will I get my Payment?</strong></p>\n\n<p><strong>3. I uploaded products but they are not live on shopking24.com Why?</strong></p>\n\n<p>&gt;&gt; We review all the product uploads to make sure the photo quality is acceptable and the products are not illegal/offensive in nature. so we can reject your product. so please ensure check the all information and send for quality check and we will live your product with in 10 minutes.</p>\n\n<p><strong>5. Do I need to invoice the customer?</strong></p>\n\n<p>&gt;&gt; Yes, invoicing to customer and any taxation related to either domestic sale is strictly your responsibility. shopking24.com is a platform which provides selling related services and therefore charges service commission for the sale from you.</p>\n\n<p><strong>6. How do I get more marketing support from Craftsvilla?</strong></p>\n\n<p>&gt;&gt; Craftsvilla.com is a neutral platform and supports marketing of seller shops in a neutral manner. However, we promote sellers which update/add products more frequently, have great photo quality, have good dispatch history with minimum refunds and have good product price/quality. We do have paid marketing support for promotion which you can request from your vendor panel after buying requisite marketing packs.</p>\n\n<p><strong>7. Do you have any listing charges?</strong></p>\n\n<p>&gt;&gt; Currently we do not have any per item listing charges. You are free to upload as many products you want.</p>\n\n<p><strong>8. Do you provide support in uploading the products?</strong></p>\n\n<p>&gt;&gt; Yes, 100 % we have a outsourced web production team.&nbsp; We will be happy to connect you to them if you need uploading support. and you will contact to your account manager.</p>\n\n<p><strong>9. How do I login to my vendor panel?</strong></p>\n\n<p>&gt;&gt; Please login to your vendor panel here with your email id and password: <a href="file:///D:/Flipkart/INFORMATION/www.shopking24.com/marketplace/vendor">www.shopking24.com/marketplace/vendor</a></p>\n\n<p><strong>10. How will I know if I received any order?</strong></p>\n\n<p>&gt;&gt; We send you instant email and sms for any order received by you. Also the orders will be available in your vendor panel.</p>\n\n<p><strong>13. I have forgotten my vendor panel password. How do I reset it?</strong></p>\n\n<p>&gt;&gt; Please send email to sellerhelp@shopking24.com to reset your password.</p>\n\n<p>Hope these answers to your general queries will help you.</p>\n\n<p>Thanks for your time. Enjoy Selling!</p>\n\n<p><strong>Regards</strong></p>\n\n<p><strong>shopking24 sellers Team</strong></p>\n\n<p><strong>shopking24.com - E-commerce Marketplace</strong></p>\n'),
(7, 'Buyer FAQ', 'buyer-faq', 'http://localhost/flipkart/buyer-faq', '<p><span style="font-size:16px"><strong>How do I get defective Item replaced ?</strong></span></p>\n\n<p>We are sorry that the item received was defective in nature. Don&rsquo;t worry! We will send you a replacement ASAP without any extra cost. You need to notify us at info@shopking24.com of any damage (defect) within 48 hours of receipt of the product with the photograph of damaged goods.&nbsp; we will get replace product.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>How can I cancel my order?</strong></span></p>\n\n<p>Should you changed your mind about the order after you have placed it with shopking24.com but before it is dispatched. We will be happy to cancel the order and give you the full refund for the order that you have already paid. As we want 100% Satisfied customers.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>How do I change my Order?</strong></span></p>\n\n<p>You can make changes to your order for e.g. Add Items to your order or delete items to your order before it gets dispatched from the vendor or shopking24.com in Delivery. To make the Change simply email us with your order Number and changes on info@shopking24.com</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>How Can I Return a Product?</strong></span></p>\n\n<p>We have a customer friendly return policy &ndash; we will refund you the full amount of the order. However, return shipping cost is incurred by the buyer.&nbsp; We accept returns within 7 days from the date of delivery.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>How much time does Refund take</strong></span></p>\n\n<p>Refund of the payments is initiated within 1 working day of Seller receiving their package back. Refunds are completed by Account Team of shopking24.com within 3 business days. After the refund is completed from our end it will take following number of days to reflect in your account depending on your mode of payment Refunds.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>VBV/ MSC / Visa/ MasterCard 3D SecureCode</strong></span></p>\n\n<p>shopking24.com payment gateway is powered by payumoney Customer(s) who are intend to accomplish an online purchase through Visa card or Master Card should enable the Verified by Visa/MasterCard 3D SecureCode feature by getting in touch with their card issuing bank. Payment gateway will not allow the card which rupay.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>Netbanking Options</strong></span></p>\n\n<p>shopking24.com payment process is powered by payumoney, payumoney taking all banking netbanking</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>Can I Pay Online?</strong></span></p>\n\n<p>Yes &ndash; You can pay online. You can make online payment through Debit Cards, Credit Cards, Cash Cards or Net Banking. We accept al type of card payments including Visa,Master Card,American Express,Maestro.You will required to enter your following details to make the online payment using your card 1) Card Number 2) Card Expiry Date 3).</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>Do you offer Cash on Delivery (COD) / Pay on Delivery ?</strong></span></p>\n\n<p>Yes we are currently accepting Cash on Delivery. You can also pay by Credit card, Debit card, Netbanking or Online bank transfer. You don&rsquo;t need to worry about your money whether you are playing through credit card or cash, as money does not get forwarded to seller unless and until the item is delivered to your address.</p>\n\n<p>&nbsp;</p>\n'),
(8, 'Terms of Use', 'terms-of-use', 'http://localhost/flipkart/terms-of-use', '<p><strong>PLEASE READ THESE TERMS OF USE (&quot;AGREEMENT&quot; OR &quot;TERMS OF USE&quot;) CAREFULLY BEFORE USING THE WEBSITE AND SERVICES OFFERED BY shopking24 ONLINE SERVICES . (&quot;shopking24&quot;). THIS AGREEMENT SETS FORTH THE LEGALLY BINDING TERMS AND CONDITIONS FOR YOUR USE OF THE WEBSITE AT <a href="file:///D:/Flipkart/INFORMATION/www.shopking24.com">www.shopking24.com</a> (THE &quot;SITE&quot;) AND ALL SERVICES PROVIDED BY shopking24 ON THE SITE.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>By using the Site in any manner, including but not limited to visiting or browsing the Site, you (the &quot;user&quot; or &quot;you&quot;) agree to be bound by this Agreement, including those additional terms and conditions and policies referenced herein and/or available by hyperlink. This Agreement applies to all users of the Site, including without limitation users who are vendors, customers, merchants, contributors of content, information and other materials or services on the Site.</p>\n\n<p>&nbsp;</p>\n\n<p><span style="font-size:16px"><strong>Membership Eligibility and Registration</strong></span></p>\n\n<p><strong>Age:</strong></p>\n\n<p>shopking24&#39;s services are available only to, and may only be used by, individuals who are 18 years and older who can form legally binding contracts under applicable law. You represent and warrant that you are at least 18 years old and that all registration information you submit is accurate and truthful. shopking24 may, in its sole discretion, refuse to offer access to or use of the Site to any person or entity and change its eligibility criteria at any time. This provision is void where prohibited by law and the right to access the Site is revoked in such jurisdictions. Individuals under the age of 18 must at all times use shopking24&#39;s services only in conjunction with and under the supervision of a parent or legal guardian who is at least 18 years of age. In these cases, the adult is the user and is responsible for any and all activities.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Account Information:</strong></p>\n\n<p>You must keep your account information up-to-date and accurate at all times, including a valid email address. You must use every effort to keep your password safe and should not disclose it to any other person. You shall not transfer or sell your User Name to any other person.</p>\n\n<p>shopking24&#39;s services are not available to temporarily or indefinitely suspended shopking24 members. shopking24 reserves the right, in shopking24&#39;s sole discretion, to cancel unconfirmed or inactive accounts. shopking24 reserves the right to refuse service to anyone, for any reason, at any time.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Fees and billing&nbsp;</strong></p>\n\n<p>Our fees and sales commission are described in our Fees Policy. Changes to the Fees Policy and the fees for shopking24&#39;s services are effective after shopking24 provides you with at least fifteen (15) days&#39; notice by posting the changes on the Site. However, shopking24 may choose to temporarily change the Fees Policy and the fees for shopking24&#39;s services for promotional events (for example, free listing days); such changes are effective when shopking24 posts the temporary promotional event on the Site. Unless otherwise stated, all fees are quoted in Indian Rupees (INR).</p>\n\n<p>&nbsp;</p>\n\n<p><strong>VAT and other taxes</strong></p>\n\n<p>The seller is solely responsible for the payment of VAT and other taxes applicable to the seller. The seller should take care of including this in the product price and must not charge the buyer tax above and over the listed product price. Wherever the sales of a product needs a special government permit or any other documentations as applicable (in case of a b2b shipping to specific states, etc) the seller shall take the responsibility to obtain the same.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Listing and Selling</strong></p>\n\n<p>Registered users of shopking24.com can create their personal shop on shopking24.com. All items and offers of a user will be listed in this shop. shopking24 is an exclusive marketplace for designer items. If your products don&rsquo;t fit into these, you may not be allowed to open a shop at shopking24, unless the management accepts to treat you as an exception. Sellers are solely responsible for all items listed in their shop and for the compliance with legal regulations. Information provided by you in the course of setting up a shop shall be true, accurate and complete. You are obliged to update this data as necessary and to always provide up-to- date information.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Minimum Value:</strong></p>\n\n<p>All products listed on shopking24 must have a price greater than INR 300. Products cheaper than INR 300 will not be accepted for listing.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Listing Description :</strong></p>\n\n<p>By listing an item on the Site you warrant that you and all aspects of the item comply with shopking24&#39;s published policies. You also warrant that you may legally sell the item. You must accurately describe your item and all terms of sale in your shopking24 shop. Your listings may only include text descriptions, graphics, pictures and other content relevant to the sale of that item. All items must be listed in an appropriate category. Each listing must accurately and completely describe the item/items for sale in that listing</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Binding Sale:</strong></p>\n\n<p>Listed items represent a binding offer at the set price to other users who comply with the conditions specified in the offer. The contract of purchase is formed when a user complies with the conditions specified in the offer and completes the checkout process. All sales are binding. The seller is obligated to ship the order in a prompt manner once the buyer has completed the transaction on shopking24. The buyer is obligated to deliver appropriate payment for items purchased, unless there is an exceptional circumstance.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Shop Policies:</strong></p>\n\n<p>All sellers are urged to outline shop policies for their shopking24 shop. These policies may include, for example, shipping, returns and selling policies. Sellers must create reasonable policies in good faith and must abide by such policies. All shop policies must comply with shopking24&#39;s site-wide policies. Sellers are responsible for enforcing their own reasonable shop policies. shopking24 reserves the right to request that a seller modify a shop policy</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Offers &amp; Promotions:</strong></p>\n\n<p>By listing an item on shopking24, you give shopking24 right to use images for marketing and promotional purposes.</p>\n\n<p>You are responsible for ensuring that you have the right to use all content on your listing and that shopking24 has the right to host it on our servers. All content may only refer to the items listed on shopking24 and may not advertise goods not listed on shopking24.com. All information relevant to the purchase decision must be true, accurate and complete. All information related to payment, delivery and delivery time must be complete. As a business person offering goods and services to consumers you are obligated to give all necessary information regarding consumer protection as required by law and to detail legal disclaimer rights if required by law. shopking24 reserves the right to unlist and delete items if an item infringes legal regulations, these Terms &amp; Conditions or the principle and rules of shopking24.com.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Buying</strong></p>\n\n<p>By purchasing an item you agree to be bound by the conditions of sale included in the item&#39;s description provided that those conditions of sale are not in breach of this User Agreement or otherwise unlawful. shopking24 is not responsible for the side effects one might endure by the use of the products sold at shopking24. shopking24 takes all steps to ensure that the seller is genuine but cannot guarantee the quality, safety or legality of any aspect of the items listed or the accuracy of the listings.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Cancellation by shopking24.com</strong></p>\n\n<p>Such situations are avoided but if raised please note that there may be certain orders that we are unable to accept and must cancel. We reserve the right, at our sole discretion, to refuse or cancel any order for any reason. Some situations that may result in your order being canceled include limitations on quantities available for purchase, inaccuracies or errors in product or pricing information, or problems identified by our credit and fraud avoidance department. We may also require additional verifications or information before accepting any order. We will contact you if all or any portion of your order is canceled or if additional information is required to accept your order. If your order is cancelled after your credit card has been charged, the said amount will be reversed back in your Card Account.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Can I cancel the Order?</strong></p>\n\n<p>The customer can only cancel the order within 24 hours of placing the order. No cancellations will be processed after 24 hours. Once you request the cancellation of item(s) in your order, it will take us a maximum of 4 business days to cancel the order and initiate a refund as per refund policy. You will be notified of the same.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Can I change my shipping address after placing an order?</strong></p>\n\n<p>Please be advised that your shipping address cannot be revised after the order has been placed successfully.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Customer not available at time of delivery.</strong></p>\n\n<p>If the courier company has made 3 attempts to deliver your package and you were not available to accept/receive the package then the courier company will abandon or destroy the shipment at their destination. However we recommend you to contact the local courier office along with your tracking number for an alternate delivery instruction. Please be aware that once the courier company destroys or abandons your shipment, we will not be responsible for not fulfilling the order.</p>\n\n<p>If you wish to avail refund in such a case, we will refund only after we receive the returned shipment package and subsequently a deduction of two way return shipping charges will be applied for seller.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Return policy.</strong></p>\n\n<p>We have a customer friendly return policy .You will have to just write us on care@shopking24.com within 24 hrs from time of delivery &amp; return steps will given from our customer support executive.</p>\n\n<p>1. Provide us with the tracking details of the product. Without this packages could get lost and replacement might be cancelled.</p>\n\n<p>2. Mention the Company Name shopking24.com and Order Number ( starting with S) on the return package.</p>\n\n<p>Last date of return shipping :- 7 days from date of delivery.We will not be able to accept returns if dispatched after 7 days from date of delivery.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Return Shipping Cost:</strong></p>\n\n<p>The cost of return shipping will not be covered by shopking24.com Please note that the below return policy is NOT applicable on orders that are custom made or custom stitched.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Options after Return:</strong></p>\n\n<p>You can choose to do one of the following</p>\n\n<p>1. Request a replacement, either the same item or a different item from the website</p>\n\n<p>2. Request a coupon code of same value for purchase later on the website. Using the coupon code, you can select anything on the website upto the returned value.</p>\n\n<p>3. Request a refund. We will do a direct refund to the card through which payment was completed. In case the payment was done with cash, kindly provide us your bank account details.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Packaging Advice:</strong></p>\n\n<p>It is of utmost importance that the items do not get damaged on their return shipping. For Jewellery, please use cotton, bubble wrap, paper or foam to do some kind of padding around the product. For Apparel, please cover the package in polythene plastic and return it in an envelope to avoid damage due to rain. In case of international parcels, the package should be returned with signature requirement upon delivery. This is done to ensure that we receive the parcel correctly/safely.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Conditions of Return</strong></p>\n\n<p>Clothes and jewellery must not be used (other than for trial), altered, washed, soiled or damaged in any way.Return is acceptable only within 7 days from date of delivery. Original tags and packaging should be intact. For items that come in branded packaging, the box should be undamaged.Returns shipping cost will not be covered by shopking24.com &#39;Made to order&#39; Clothes and jewellery are not covered under the return policy.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>What we do about mispricings</strong></p>\n\n<p>Despite our best efforts, a small number of the many thousands of items in our catalogue are mispriced. However, we verify prices as part of our dispatch procedures. If an item&#39;s correct price is lower than our stated price, we charge the lower amount and send you the item. If a product&#39;s correct price is higher than our stated price, we will cancel your order and notify you of that cancellation.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Cancellation of Fraudulent/Loss to business Orders</strong></p>\n\n<p>To provide a safe and secure shopping experience, we regularly monitor transactions for fraudulent activity. In the event of detecting any suspicious activity, shopking24.com reserves the right to cancel all past, pending and future orders without any liability. shopking24.com also reserves the right to refuse or cancel orders in scenarios like inaccuracies in pricing of product on website and stock unavailability. We may also require additional verifications or information before accepting any order. We will contact you if all or any portion of your order is cancelled or if additional information is required to accept your order. If your order is cancelled after your card has been charged, the said amount will be reversed to your Card Account. Any promotional voucher used for the cancelled orders may not be refunded.</p>\n\n<p>The customer may be considered fraudulent if any of the following scenarios are met:</p>\n\n<p>Customer doesn&#39;t reply to the payment verification mail sent by shopking24</p>\n\n<p>Customer fails to produce adequate documents during the payment details verification</p>\n\n<p>Misuse of another customer&#39;s phone/email</p>\n\n<p>Customer uses invalid email and phone no.</p>\n\n<p>Overuse of a voucher code</p>\n\n<p>Customer returns the wrong product</p>\n\n<p>Customer refuses to pay for an order</p>\n\n<p>Customer is involved in the snatch and run for any order.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Damage</strong></p>\n\n<p>We try our best to delivery 100% good quality products,but unfortunately it may happen sometimes product is delivered damaged.In such case we required a photo to be sent to us within&nbsp; 48hrs from the time of delivery.Without photos sent in given time we will not be able to process replacement.In case of products not avialble return Upon receiving the photo, our team will review the damage. If the damage is approved and a complaint is registered, we request you to kindly send the product back to us. If a replacement is in stock with us, we will reship the same to you. In case it is not available, you can request for a refund or a coupon for future purchases. But the final dession is will be taken by shopking24.com about refund.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Color &amp; Description Disclaimer</strong></p>\n\n<p>The details of the products or product specifications (for instance weight, color, handwork details, size, etc.) quoted with the product displays are only approximate values. While every endeavor has been made to accurately reproduce colors, there may be minor variations in color of the actual product because of the nature of fabric dyes, weather at the time of dying and differences in display output due to lighting and digital photography and color settings and capabilities of monitors. A customer must place an order keeping in mind this minor variation in color as seen on a computer screen against the actual color of the outfit received. shopking24.com firmly believes that all the customers who order online are aware that colors seen on a monitor will be slightly different as compared to the actual outfits or accessories ordered. It is practically impossible for shopking24.com&rsquo;s&nbsp;&nbsp; Designers to replicate the same colors on an outfit as seen on your monitor. A variation in the shade selected by you is considered as a normal practice as these garments have a tendency to reflect different shades of a color under different light and weather, type of camera used for photography or type and settings on the computer monitor. We wish to clarify and ascertain that every customer who orders any outfit from shopking24.com is aware of this genuine problem.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>While ordering on internet, we suggest that customers should be extra careful of following -</strong></p>\n\n<p>1. Red, maroon and orange colors have a higher tendency to reflect a different shade than other colors. For example even if you yourself try to photograph from a digital camera or scan a red garment, in most of the cases it will show either as maroon or orange on the computer monitor and vice versa. Though imaging technology has advanced, still no foolproof solution to this problem is available at the moment.</p>\n\n<p>2. Many a time&rsquo;s green and blue shades also overlap. Same is the case with off-white, white and cream colors.</p>\n\n<p>3. Sea Green color sometimes looks Aqua blue and the other way around.</p>\n\n<p>4. Some fabrics like raw silk, khadi silk, cotton silk, south cotton, brocade have a textured effect where we can see the weaving &amp; threads are visible in different directions which is an inherent characteristic or feature of that fabric and proof of its authenticity. These are not defects. This raw finish is the beauty of these fabrics.</p>\n\n<p>5. Handcrafted, hand dyed, hand printed, hand painted, hand embroidered, handloom, hand weaved products will always have minor differences when we compare them as they are not made by machines. Each piece will be unique. Handicraft artisans always try their best to make each piece better than the previous one. So, the product will always have minor variation keeping the same theme constant in artistic manner. The raw finish of the handicrafts cannot be compared with machine finished products as this raw finish is the beauty of the handicrafts items.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Beads and Sequences missing or Coming off</strong></p>\n\n<p>We believe that customers who are ordering items with sequins and other beaded embroidery are aware of the fact that these shiny embellishments have a tendency to come off. Even with the best of handling and care this cannot be avoided altogether. Many a times during strict physical checking at the customs during transit, more than usual sequences and beads come off. Many a times it may happen that you open a box and find some pieces falling down on the floor. Or you wear the dress and in few hours you might lose some of them. Do not panic or over-react because if you look with a magnifying glass at any such dresses / saris worn by others, you will most certainly find some pieces missing or almost at a state of falling down. Your are deemed to have accepted the terms and conditions.&nbsp; shopking24.com reserve right to time modify the Terms &amp; Conditions of Use of the site without any prior notification to you.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Process for Pilferage Claim</strong></p>\n\n<p>If a customer raises a complaint for partial item/partial order through Customer Care</p>\n\n<p>The customer is supposed to claim for pilferage within 48 hours of delivery failing which the claim will not be entertained</p>\n\n<p>An Email will be sent to care@shopking24.com seeking/providing following information:</p>\n\n<p>Short description of the case (A few questions will be asked to help us understand the scenario)</p>\n\n<p>The snapshots of the packet and other box(If any)(Try to cover the sides which look tampered/damaged as per the customer)</p>\n\n<p>The refund for prepaid orders will be done after investigation which usually requires 3-4 business day. The process will include investigation with the concerned departments</p>\n\n<p>&nbsp;</p>\n\n<p><strong>The customer may not be liable for a refund if he/she falls in any of the scenarios stated below:</strong></p>\n\n<p>Customer fails to provide adequate information about the case</p>\n\n<p>Customer fails to provide snapshots of the packet and box(if any)</p>\n\n<p>Customer must not dispose the packaging for 3-4 days post delivery and wait for next details to be sent by customer support team.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Refund Policy</strong></p>\n\n<p>shopking24 reserves the sole right to accept or deny refunds and will act reasonably in the common interest of both parties involved. Purchases are only retractable in exceptional circumstances, such as when the seller materially changes the item&#39;s description after a purchase has been made, a clear typographical error is made, or there if a seller defaults in any way with the product listed or in the delivery of the same. In case of returns without delivery of product refund cannot be processed.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Prohibited Items</strong></p>\n\n<p>You are prohibited from engaging in selling or buying of the items listed in the prohibited items list. Prohibited Items list.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Prohibited Activities</strong></p>\n\n<p>All activities of users while using shopking24.com or any service provided by shopking24 shall be in accordance with legal regulations. Content provided by users on shopking24.com shall not infringe legal regulations or these Terms &amp; Conditions. Your information and your activities must not:</p>\n\n<p>be false, inaccurate or misleading;</p>\n\n<p>be offensive or menacing, abusive, defamatory;</p>\n\n<p>be obscene, indecent or contain child pornography;</p>\n\n<p>infringe any third party&#39;s copyright, patent, trade mark, trade secret or other proprietary rights or rights of publicity or privacy;</p>\n\n<p>be fraudulent or involve the sale of counterfeit or stolen items;</p>\n\n<p>be in breach of any applicable laws or regulations (including, but not limited to, laws governing export control, consumer protection, unfair competition, anti- discrimination, false advertising);</p>\n\n<p>copy, reproduce, modify, create derivative works from, distribute or publicly display any content (except for your information) from shopking24.com without the prior expressed written permission of shopking24 and the appropriate third party, as applicable.</p>\n\n<p>create liability for us or cause us to lose (in whole or in part) the services of our ISPs or other sellers or customers;</p>\n\n<p>link directly or indirectly to or include descriptions of goods or services that are prohibited under these Terms &amp; Conditions ;</p>\n\n<p>Violate this Agreement or any other shopking24 policy or guidelines, or any applicable law, statute, ordinance or regulation.</p>\n\n<p>add a shopking24 employee or a shopking24 user, even a user who has purchased an item from you, to your mail list (email or physical mail) without their express consent after adequate disclosure;</p>\n\n<p>contain any computer viruses, macro viruses, trojan horses, worms or anything else designed to interfere with, interrupt or disrupt the normal operating procedures of a computer or to surreptitiously intercept, access without authority or expropriate any system, data or personal information;</p>\n\n<p>cause the Site to be interrupted, damaged, rendered less efficient or such that the effectiveness or functionality of shopking24.com is in any way impaired</p>\n\n<p>not use any robot, spider, scraper or other automated means to access the Site for any purpose without our express written permission</p>\n\n<p>be defamatory, trade libelous, unlawfully threatening, unlawfully harassing, impersonate or intimidate any person (including shopking24 staff or other users), or falsely state or otherwise misrepresent your affiliation with any person, through for example, the use of similar email address, nicknames, or creation of false account(s) or any other method or device</p>\n\n<p>be obscene or contain pornography</p>\n\n<p>host images not part of a listing</p>\n\n<p>You must not list any item on shopking24.com (or complete any transaction initiated using shopking24.com) that, by paying to us the listing fee or the final value fee, could cause us to violate any applicable law or our items policy. To enable shopking24 to use your information, you grant us a non-exclusive, world-wide, perpetual, irrevocable, royalty-free, sub licensable (through multiple tiers) licence to exercise the copyright, trade mark, publicity, and database rights you have in your Information, in any media now known or not currently known. You also waive all moral rights you have in your information to the fullest extent permitted by law. The license described above shall terminate upon termination or cancellation of this User Agreement by either party.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Cancellation</strong></p>\n\n<p>shopking24 reserves the right to cancel this User Agreement at any time and for any reason with a notice period of 7 days. Suspended users are not permitted to use shopking24.com and to create a new user account. You can cancel the User Agreement at any time in writing to shopking24.com ecommerce Marketplace&nbsp;or to team@shopking24.com</p>\n\n<p>&nbsp;</p>\n\n<p><strong>Liability &amp; Warranty</strong></p>\n\n<p>in no event shall shopking24, and (as applicable) shopking24&#39;s subsidiaries, officers, directors, employees or shopking24&#39;s suppliers be liable for any damages whatsoever, whether direct, indirect, general, special, compensatory, consequential, and/or incidental, arising out of or relating to the conduct of you or anyone else in connection with the use of the site, shopking24&#39;s services, or this agreement, including without limitation, lost profits, bodily injury, emotional distress, or any special, incidental or consequential damages. shopking24&#39;s liability, and (as applicable) the liability of shopking24&#39;s subsidiaries, officers, directors, employees, and suppliers, to you or any third parties in any circumstance is limited to the greater of (a) the amount of fees you pay to shopking24 in the 12 months prior to the action giving rise to liability, and (b) inr1000. some states do not allow the exclusion or limitation of incidental or consequential damages, so the above limitation or exclusion may not apply to you.</p>\n\n<p>shopking24 is not liable for contracts formed between users of shopking24.com. shopking24 is not liable for information on shopking24.com provided by its users. We claim no intellectual property rights over the material provided by users of shopking24.com.</p>\n\n<p><strong>No Guarantee:</strong></p>\n\n<p>shopking24 does not guarantee continuous, uninterrupted access to the Site, and operation of the Site may be interfered with by numerous factors outside shopking24&#39;s control.</p>\n\n<p><strong>Indemnity:</strong></p>\n\n<p>you agree to indemnify and hold shopking24 and (as applicable) shopking24&#39;s parent, subsidiaries, affiliates, officers, directors, agents, and employees, harmless from any claim or demand, including reasonable attorneys&#39; fees, made by any third party due to or arising out of your breach of this agreement or the documents it incorporates by reference, or your violation of any law or the rights of a third party.</p>\n\n<p><strong>Notices</strong></p>\n\n<p>Except as explicitly stated otherwise, any notices to shopking24 shall be given by certified&nbsp; mail, postage prepaid and return receipt requested to shopking24 Online Services. and any notices to you shall be given to you via the email address you provide to shopking24.com during the registration process. In such case, notice shall be deemed given 3 days after the date of mailing. Notice shall be deemed given 24 hours after email is sent, unless the sending party is notified that the email address is invalid. Alternatively, we may give you notice by certified mail, postage prepaid and return receipt requested, to the address provided to shopking24.com during the registration process. In such case, notice shall be deemed given 3 days after the date of mailing.</p>\n\n<p><strong>Disclaimer</strong></p>\n\n<p>We, our subsidiaries, officers, directors, employees and our suppliers provide the Site and the Services on an &quot;as is&quot; basis and without any warranty or condition, express, implied or statutory. We do not guarantee and do not promise any specific results from use of the Site and/or the Services. If any provision of this User Agreement is held to be invalid or unenforceable, such provision shall be struck out and the remaining provisions shall be enforceable. We reserve the right to alter these Terms &amp; Conditions at any time. If the alterations constitute a material change to the Terms &amp; Conditions , we will notify you via email according to the preference expressed on your account. What constitutes a &quot;material change&quot; will be determined at our sole discretion, in good faith and using common sense and reasonable judgement. You agree that this User Agreement and all incorporated agreements may be automatically assigned by shopking24, in our sole discretion, to a third party in the event of a merger or acquisition or any other event. You and shopking24 are independent contractors, and no agency, partnership, joint venture, employee-employer or franchisor-franchisee relationship is intended or created by this User Agreement. Headings are for reference purposes only and in no way define, limit, construe or describe the scope or extent of such section. Our failure to act with respect to a breach by you or others does not waive our right to act with respect to subsequent or similar breaches. This User Agreement sets forth the entire understanding and agreement between us with respect to its subject matter. No oral explanation or oral information given by any party shall alter the interpretation of this User Agreement. This Agreement will prevail over any conditions of sale imposed by a seller. Our Fees Policy is incorporated in this User Agreement by reference. The fees policy may be amended from time to time and material changes will be posted on the Site and sent to you at your registered email address.</p>\n'),
(9, 'Privacy Policy', 'privacy-policy', 'http://localhost/flipkart/privacy-policy', NULL),
(10, 'Our Team', 'our-team', 'http://localhost/flipkart/our-team', NULL);
INSERT INTO `pages` (`page_id`, `title`, `name`, `url`, `content`) VALUES
(11, 'seller policy and rule', 'seller-policy-and-rule', 'http://localhost/flipkart/seller/seller-policy-and-rule', '<p><span style="font-size:16px"><strong>General Policies and Rules</strong></span><br />\r\nshopking24&#39; policies and rules are the common guidelines that create a safe, trusted and fair trading environment for all shopking24.com members. To promote a safe and trusted trading environment, shopking24.com enforces these polices and rules.<br />\r\nUser agreement. This is the most important shopking24.com policy and rule document. All members are responsible for reviewing and understanding shopking24&#39; policies and all applicable laws and regulations contained in this legal contract.<br />\r\nRules for Everyone. General policies applying to all shopking24.com members, shopking24 employees and shopking24.com. This section includes rules that protect your privacy and your identity. Learn more about issues like the use of profanity, unsolicited email (spam) etc.<br />\r\nProhibited and Restricted Items. There are many items that are restricted to sell online at shopking24.com, such as liquor, adult content/material, banned items such as ivory etc? Find out in our comprehensive list of banned and restricted items.<br />\r\nKeyword Spamming Policy. This policy is designed to restrict merchants not to abuse brand names as keywords in product listings to drive attention.<br />\r\nLinks Policy &ndash; This policy is designed to restrict merchants to inappropriately add links in its product listings or online storefront to move traffic away from shopking24.<br />\r\nRules about Intellectual Property. shopking24.com has zero tolerance for any intellectual property violations. Please notify us in case any violation has occurred withour knowledge and we will take appropriate action as soon as possible.<br />\r\nshopking24s rules and policies are designed to:<br />\r\n&bull; Minimize risks to both buyers and sellers<br />\r\n&bull; Support government laws and regulations<br />\r\n&bull; Provide equal opportunity to all buyers and seller<br />\r\n&bull; Protect intellectual property rights<br />\r\n&bull; Provide an enjoyable buying experience&nbsp;<br />\r\n&bull; Support the values of the shopking24.com Community<br />\r\nPlease learn more about shopking24&#39; policies that will help you avoid breaking rules (including the law) and helps you in trading with reliable, trustworthy buyers and sellers.<br />\r\nViolations of policy may result in a range of actions including:<br />\r\n&bull; Listing cancellation<br />\r\n&bull; Store suspension<br />\r\n&bull; Limits on account privileges&nbsp;<br />\r\n&bull; Account suspension<br />\r\n&bull; Loss of Top Rated Merchant status&nbsp;<br />\r\nNote: You may contact shopking24.com to report violations by using the &quot;Report&quot; or &quot;Contact Us&quot; links found on most policy pages.<br />\r\nBack to top</p>\r\n\r\n<p><strong><span style="font-size:16px">Prohibited and Restricted Items</span></strong><br />\r\nFollowing items are not allowed to be sold/displayed online at shopking24.com. Please note that merchants/sellers are responsible for any legal issues and other liabilities arising if you try and sell these below mentioned items at shopking24.com. We will cancel the listing of prohibited and restricted items within 24 hours after we come to know about such occurrence.<br />\r\n&bull; Adult Material which includes pornography and other sexually suggestive materials (including literature, imagery and other media); escort or prostitution services<br />\r\n&bull; Alcohol including alcoholic beverages such as beer, liquor, wine or champagne)<br />\r\n&bull; Animals and Wildlife Products - examples include live animals, mounted specimens, and ivory<br />\r\n&bull; Artifacts prohibited for sale<br />\r\n&bull; Beta Software<br />\r\n&bull; Bootleg/Pirated Recordings<br />\r\n&bull; Brand Name Misuse<br />\r\n&bull; Bulk marketing tools which include email lists, software, or other products enabling unsolicited email messages (spam)<br />\r\n&bull; Cable descramblers and black boxes which includes devices intended to obtain cable and satellite signals for free<br />\r\n&bull; Catalogue and URL Sales<br />\r\n&bull; Child pornography which includes pornographic materials involving minors<br />\r\n&bull; Copies of unauthorized Copyrighted materials whether in electronic or physical form or any other medium which may not be in existence at present<br />\r\n&bull; Counterfeit Currency and Stamps<br />\r\n&bull; Drugs and drug paraphernalia which includes illegal drugs and drug accessories, including herbal drugs like salvia and magic mushrooms<br />\r\n&bull; Drug test circumvention aids which includes drug cleansing shakes, urine test additives, and related items<br />\r\n&bull; Embargoed Goods and Prohibited Countries<br />\r\n&bull; Endangered species which includes plants, animals or other organisms (including product derivatives) in danger of extinction<br />\r\n&bull; Event Tickets<br />\r\n&bull; Firearms, Ammunition, Militaria and Knives<br />\r\n&bull; Fireworks, Explosives and Explosive Substances; toxic, flammable and radioactive materials and substances<br />\r\n&bull; Gaming/gambling which includes lottery tickets, sports bets, memberships/ enrolment in online gambling sites, and related content<br />\r\n&bull; Government IDs and Licenses which includes fake Ids, passports, diplomas and noble titles<br />\r\n&bull; Hacking and cracking materials which includes manuals, how-to guides, information, or equipment enabling illegal access to software, servers, watomites, or other protected property<br />\r\n&bull; Hazardous and Restricted Items<br />\r\n&bull; Human Parts and Remains<br />\r\n&bull; Items Encouraging Illegal Activity &ndash; examples include an eBook describing how to create methamphetamine<br />\r\n&bull; Miracle cures which includes unsubstantiated cures, remedies or other items marketed as quick health fixes<br />\r\n&bull; Multi level marketing collection fees<br />\r\n&bull; Copyright unlocking items that includes Mod Chips or other devices designed to circumvent copyright protection<br />\r\n&bull; Movie Prints<br />\r\n&bull; Offensive Material - examples include ethnically or racially offensive material or any literature, products or other materials that: a) Defame or slander any person or groups of people based on race, ethnicity, national origin, religion, sex, or other factors b) Encourage or incite violent acts c) Promote intolerance or hatred<br />\r\n&bull; Offensive goods, crime which includes crime scene photos or items, such as personal belongings, associated with criminals<br />\r\n&bull; Police, Army, Navy and Air force Related Items<br />\r\n&bull; Pre-Sale Listings<br />\r\n&bull; Prescription drugs or herbal drugs or any kind of online pharmacies which includes drugs or other products requiring a prescription by a licensed medical practitioner<br />\r\n&bull; Promotional Item<br />\r\n&bull; Real Estate<br />\r\n&bull; Regulated goods which includes air bags; batteries containing mercury; Freon or similar substances/refrigerants, chemical/industrial solvents, government uniforms, car titles or logos, license plates, police badges and law enforcement equipment, lock-picking devices, pesticides; postage meters, recalled items, slot machines; goods regulated by government or other agency specifications<br />\r\n&bull; Replica and Counterfeit Items including imitations of designer goods; items without a celebrity endorsement that would normally require such an association, fake autographs, counterfeit stamps, and other potentially unauthorized goods<br />\r\n&bull; Ringtones<br />\r\n&bull; Stocks and Other Securities or related financial products<br />\r\n&bull; Stolen Property<br />\r\n&bull; Surveillance Equipment<br />\r\n&bull; Tobacco and cigarettes includes cigarettes, cigars, chewing tobacco, and related products<br />\r\n&bull; Traffic devices which includes radar detectors/ jammers, license plate covers, traffic signal changers, and related products<br />\r\n&bull; Weapons which includes firearms, ammunition, knives, brass knuckles, gun parts, and other armaments<br />\r\n&bull; Wholesale currency which includes discounted currencies or currency exchanges<br />\r\n&bull; Work-at-home information<br />\r\n&bull; Matrix sites or sites using a matrix scheme approach<br />\r\n&bull; Any kind of services not related to products<br />\r\n&bull; Any other product or service which is not in compliance with all the applicable laws and regulations whether federal, state, local or international including the laws of India<br />\r\nSHOPCLUES.COM RESERVES THE RIGHT TO MODIFY, UPDATE AND ALTER THE LIST FROM TIME TO TIME WITHOUT ANY PRIOR INTIMATION. TO MAKE SURE YOU ARE AWARE OF ANY CHANGES, PLEASE REVIEW THE LIST PERIODICALLY.<br />\r\nBack to top</p>\r\n\r\n<p><span style="font-size:16px"><strong>Keyword Spamming Policy</strong></span><br />\r\nKeyword spamming occurs when merchants place brand names or other inappropriate keywords in a title or description for the purpose of gaining attention or diverting members to a listing. Keyword spamming in listings is not permitted on shopking24.com. The text sellers place in listings must be directly relevant to the item being sold.<br />\r\nViolations of this policy may result in a range of actions, including:<br />\r\n&bull; Product Listing cancellation<br />\r\n&bull; Limits on account privileges<br />\r\n&bull; Account suspension<br />\r\n&bull; Loss of Top Rated Merchant status at shopking24.com<br />\r\nBack to top</p>\r\n\r\n<p><br />\r\n<span style="font-size:16px"><strong>Links Policy</strong></span><br />\r\nIn general, when listing items on shopking24, merchants can include links that are solely intended to provide additional details about the items. That means links should only be used in circumstances when that information can&#39;t be included in the listing itself. These links include additional images, technical specifications, manufacturer warranties, and other information that can help buyers make an informed purchasing decision. Other links that point to a third-party provider&#39;s Website are also allowed, such as image hosting sites, payment processors or courier companies.<br />\r\nshopking24 doesn&#39;t allow links to non-shopking24 sites or content where other items are offered for sale. shopking24 continually reviews links on the site and reserves the right to block any link considered unsafe for our members. As a merchant, please make sure that your listing follows links policy of shopking24. If it doesn&#39;t, it may be removed, and you may be subject to a range of other actions, including limits your selling privileges and/or suspension of your account.<br />\r\nBack to top</p>\r\n\r\n<p><strong><span style="font-size:16px">Rules about Intellectual Property</span></strong><br />\r\nshopking24 is committed to protecting the intellectual property rights of third parties and to providing a safe marketplace to trade. Unauthorized use or Infringement of copyrighted material and trademarks are strictly prohibited at shopking24.<br />\r\nshopking24 has zero tolerance for any intellectual property violations. Counterfeits, unauthorized replicas, unauthorized items (such as counterfeit watches, handbags, or other accessories) or unauthorized copies (such as copies of software programs, video games, music albums, movies, television programs, or photographs) are not permitted at shopking24. Unauthorized copies include (but are not limited to) copies that are pirated, duplicated, backed-up or bootlegged. It is illegal to sell unauthorized copies of media.<br />\r\nIf the product you are selling bears the name or logo of a company, but it wasn&#39;t made or endorsed by that company, don&#39;t list it at shopking24.<br />\r\nAcademic software is software sold at significantly discounted prices to students, faculty members and educational institutions. Do not list academic copies of software At shopking24 unless you are authorized to do so as an educational reseller, an educational institution a student or a faculty member.<br />\r\nBeta software, test software and evaluation software are not permitted at shopking24. Beta, test, and evaluation copies of software are preliminary copies of software distributed by software developers strictly for the purpose of evaluation and troubleshooting.<br />\r\nDo not list &quot;OEM&quot; or &quot;bundled&quot; copies of software At shopking24 unless you are selling it with computer hardware. For Context, Original Equipment Manufacturer (OEM), or bundled software, is software that is obtained as part of the purchase of a new computer. OEM software licenses usually prohibit the purchaser from reselling the software without the computer or, in some cases, without any computer hardware.<br />\r\nBootleg recordings are unauthorized recordings of concerts or live performances. Sellers are not permitted to list bootleg recordings at shopking24.<br />\r\nViolations of this policy may result in a range of actions, including:<br />\r\n&bull; Product Listing cancellation<br />\r\n&bull; Limits on account privileges<br />\r\n&bull; Account suspension<br />\r\n&bull; Loss of Top Rated Merchant status at shopking24.com<br />\r\nBack to top</p>\r\n\r\n<p><span style="font-size:16px"><strong>Pricing Policy</strong></span><br />\r\nPlease note that trust is the most important aspect of trade between buyers and sellers in marketplace and one of the key aspects of trust is fair pricing. For healthy transaction flow at shopking24.com, we ask you to price your items responsibly.&nbsp;<br />\r\nPlease note that we are constantly monitoring prices for each merchant at various channels and do not allow you to price your items at higher prices at shopking24.com vs. other channels such as your own retail store, your own Website (if any) or any other 3rd party retail stores or Websites. You should price your items sold at shopking24.com to be same as the lowest rate you are selling at elsewhere or even lower but it should not be more. Violation of our pricing policy will result into warning notices and can also result into account suspension and/or store suspension.<br />\r\nHonesty in MRP<br />\r\nPlease note the trust you build with your buyers will go away if you artificially start showing higher MRP, so that the selling price appears to be much better deal vs. what it actually is. Artificially increasing MRP is strictly prohibited at shopking24.com and any violation will result into account suspension.<br />\r\nBack to top</p>\r\n\r\n<p><span style="font-size:16px"><strong>Customer Communication Policy</strong></span><br />\r\nSellers/merchants at shopking24.com are prohibited to engage in direct communication with buyers for any pre-sale, order, payments, shipping, post sale or returns related matters. Merchants are also not allowed to engage in direct or indirect marketing communication with buyers at shopking24. For specific product inquiries, warranties, shipping/delivery etc., shopking24 can intermediate the communication between buyer and sellers. However, sellers/merchants should not be engaged in communication with the buyers.<br />\r\nViolations of policy may result in a range of actions including:<br />\r\n&bull; Product Listing cancellation<br />\r\n&bull; Limits on account privileges<br />\r\n&bull; Account suspension<br />\r\n&bull; Loss of Top Rated Merchant status at shopking24.com</p>\r\n'),
(12, 'Seller Privacy Policy', 'seller-privacy-policy', 'http://localhost/flipkart/seller/seller-privacy-policy', '<p style="text-align: center;"><span style="font-size:22px"><strong>Overview</strong></span></p>\r\n\r\n<p><strong>This document is an electronic record in terms of Information Technology Act, 2000 and rules there under as applicable and the provisions pertaining to electronic records in various statutes as amended by the Information Technology Act, 2000. This electronic record is generated by a computer system and does not require any physical or digital signatures to make the terms of this policy binding.</strong></p>\r\n\r\n<p><br />\r\nAt Shopking24.com data protection is a matter of trust and your privacy is very important to us. We use your personal information only in the manner set out in this Privacy Policy. Please read this privacy policy to learn more about our information gathering and dissemination practices.<br />\r\nThe privacy practices of this statement apply to our services available under the domain and sub-domains of Shopking24.com (the &quot;Site&quot;) and apply generally to our parent, affiliates, subsidiaries or joint venture websites. By visiting the Site you agree to be bound by the terms and conditions of this Privacy Policy.<br />\r\nThis Privacy Policy explains how ShopShopking24.com gathers personal information, classified as mandatory or optional as part of the normal operation of our services; and uses, discloses and protects such information through the Site. This detailed privacy policy enables you to take informed decisions in dealings with us. Our parent, subsidiaries and joint ventures operate under similar privacy practices subject to the requirements of applicable law.<br />\r\nBy registering with ShopShopking24.com, you acknowledge your acceptance of the terms of this Privacy Policy, expressly consent to our use and disclosure of your personal information in accordance with this Privacy Policy and that any personal information provided by you through Shopking24.com is provided under a lawful contract. This Privacy Policy is incorporated into and subject to the terms of the User Agreement. Note: Our privacy policy is subject to change at any time without notice. To make sure you are aware of any changes, please review this policy periodically.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Your Privacy</strong></span></p>\r\n\r\n<p>At Shopking24.com, we are extremely proud of our commitment to protect your privacy. We value your trust in us. We work hard to earn your confidence so that you can enthusiastically use our services and recommend your friends and family to participate in dealing with us. Please read the following policy to understand how your personal information will be treated as you make full use of our Site.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Shopking24.com Privacy Assurance</strong></span></p>\r\n\r\n<p>Shopking24.com promises that we will not sell or rent your personal information to third parties for their marketing purposes without your explicit consent. From time to time we may reveal general statistical information about our Web site and visitors, such as number of visitors, number and type of goods and services purchased, etc. Your trust and confidence are our highest priority.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Information that Shopking24.com collects</strong></span></p>\r\n\r\n<p>When you use our Site, we collect and store your personal information. We gather your personal information in order to record, support and facilitate your participation in the activities you select, track your preferences, to provide you with a customized Site experience, to notify you of any updated information and new activities and other related functions offered by ShopShopking24.com, keep you informed about latest content available on the Site, special offers, and other products and services of Shopking24, to assist you with customer service or technical support issues, to follow up with you after your visit, to otherwise support your relationship with Shopking24 or to prevent fraud and unlawful use. For the aforesaid purpose, we only collect such personal information that we consider relevant to understand you or your interests.<br />\r\nIn general, you can visit the Site without having to provide your personal information during which time you remain anonymous and at no time can we identify you unless you have an account on the Site and log on with your user name and password. Once you provide your personal information, you are no more anonymous to us. To fully use our Site, you will need to register using our online registration form, where you may be required to provide us with your name, date of birth, contact number, email id, user id, password, residence / place of business information, billing information, shipping information, bank account details and other personal information as indicated on the forms throughout the Site. Further the fields are marked as mandatory or optional. You always have the option to not provide information by choosing not to use a particular service or feature on the Site. You may provide us with your Shopking24.com registered user ID. We may automatically track certain information about you based upon your behavior on our site. We use this information to analyze trends, administer the site, track a user&rsquo;s movement and gather broad demographic information, to better understand, protect and serve our users. This information is compiled and analyzed on an aggregated basis. This information may include the URL that you just came from (whether this URL is on our site or not), which URL you next go to (whether this URL is on our site or not), your computer browser information, and your IP address.<br />\r\nWe use data collection devices such as &quot;cookies&quot; on certain pages of the Site to help analyze our web page flow, measure promotional effectiveness, and promote trust and safety. &quot;Cookies&quot; are small files which identify your computer to our server as a unique user when you visit certain pages on the Site and they are stored by your Internet browser on your computer&#39;s hard drive. We offer certain features that are only available through the use of a &quot;cookie&quot;. We also use cookies to allow you to enter your password less frequently during a session. Cookies can also help us provide information that is targeted to your interests. Most cookies are &quot;session cookies,&quot; meaning that they are automatically deleted from your hard drive at the end of a session. You are always free to decline our cookies if your browser permits, although in that case you may not be able to use full functionality of the Site. We only use cookies for your convenience in using the Site and not for obtaining or using any other information about you. We do not control the use of cookies by third parties.<br />\r\nIf you choose to buy or sell on the Site, we collect information about your buying and selling behavior.<br />\r\nIf you are a seller, we also collect some additional information, such as a billing address, banking information other payment instrument details and tracking information from cheques or money orders.<br />\r\nIf you choose to post messages on our message boards, chat rooms or other message areas or leave feedback for other users, we retain this information as necessary to resolve disputes, provide customer support and troubleshoot problems as permitted by law.<br />\r\nIf you send us personal correspondence, such as emails or letters, or if other users or third parties send us correspondence about your activities or postings on the Site, we may collect such information into a file specific to you.<br />\r\nIf you register for the Site on another web site or use a web site providing a service for Shopking24 or a web site that helps facilitates your activity on the Site, that web site may provide personal information about you and your transactions back to us.</p>\r\n\r\n<p>Our use of your information</p>\r\n\r\n<p>We use your personal information to facilitate the services you request. We do not sell, rent, trade or exchange any personally-identifying information of our Users. We may provide your collected information to our affiliates and service providers under contract (such as customer care, data analytics) to support the operation of the Website and our services. To the extent we use your personal information to market to you, we will provide you the ability to opt-out of such uses. We use your personal information to: resolve disputes; troubleshoot problems; help promote safe trading; collect fees owed; measure consumer interest in the services provided by us, inform you about online and offline offers, products, services, and updates; customize your experience; detect and protect us against error, fraud and other criminal activity; enforce our User Agreement, and in general to improve the user experience and make it comparable to other e-commerce websites; and as otherwise described to you at the time of collection. In our efforts to continually improve our product and service offerings, we collect and analyze demographic, profile and usage data about our users&#39; activity on our Site.<br />\r\nWe use your personal information to improve our platform, improve the Site&#39;s content and product offerings, prevent or detect fraud or abuses of our website and tailor it to meet your needs, so as to provide you with a smooth, efficient, safe and customized experience while using the Site.<br />\r\nWe may also use your personal information to display contents and services that are targeted to your interests. By accepting the User Agreement and Privacy Policy, you expressly agree to receive this information. If you do not wish to receive these communications, we encourage you to opt out of the receipt of certain communications in your profile under My Account or by clicking unsubscribe any email communication. You may make changes to your profile at any time.</p>\r\n\r\n<p>Our Disclosure of your information</p>\r\n\r\n<p>Your personal information is an important part of our business and we are not in the business of selling it to others. Shopking24.com shares your personal information only to categories of persons that are either subject to this Privacy Policy or follow practices at least as protective as those described in this Privacy Policy as more particularly described below:<br />\r\n<strong>Advertisements</strong><br />\r\nA. Where a user enters information on any form of an advertiser, the information is simultaneously collected by Shopking24.com and the advertiser. The information is used by Shopking24.com in accordance with the terms of this privacy policy and is used by the advertiser as per the advertiser&rsquo;s prevalent privacy policies. Since we do not control the privacy practices of these advertisers, you should evaluate their practices before deciding to provide the said information.<br />\r\nB. Shopking24.com may also use personally identifiable information in an aggregated form and disclose to advertisers and other third parties for other marketing and promotional purposes.<br />\r\n<strong>Classifieds Listings</strong><br />\r\nWhen a user lists a classified advertisement, and the advertisement receives an expression of interest by the interested user, the interested user will be provided the contact information of the user listing the advertisement as provided in the user&#39;s registration form.<br />\r\nItems and Services offered on the Site by third parties<br />\r\nThere are certain items and services for which third parties request for information to perform services on our behalf. (example: an image/picture for a customized mug/t-shirt). The information provided by the user for such purposes is simultaneously collected by Shopking24.com and the respective third party. This information is utilized by the third party in accordance with its privacy policy and the terms of the offer. Because we do not control the privacy practices of these third parties, you should evaluate their practices before deciding to use their services.<br />\r\n<strong>Internal Service Providers</strong><br />\r\nWe may employ third parties services to facilitate or outsource one or more aspects of the business, product and service operations that we provide to you on the Site (e.g., search technology, discussion boards, bill collection, affiliate and rewards programs, co-branded credit cards) and therefore we may provide some of your personal information to these internal service providers. These internal service providers&#39; are subject to confidentiality agreements with us and other legal restrictions that prohibit their use of your personal information for any other purpose except to facilitate the specific outsourced service.. In the event of your direct involvement with the internal service provider, any additional information disclosed by you to them shall be subject to internal service provider&rsquo;s own applicable privacy policy and the Shopking24.com shall not be responsible for the same.<br />\r\n<strong>Other Corporate Entities</strong><br />\r\nWe share much of our data, including personal information about you, with our parent, affiliates, subsidiaries, and joint ventures that are committed to serving your online trading needs and related services, throughout the world. To the extent that these entities have access to your personal information, they remain bound by the existing Privacy Policy. As we continue to develop our business, we might sell or buy stores, subsidiaries or business units. In such transactions, customer&rsquo;s personal information generally is one of the transferred business assets but remains subject to the promises made in any pre-existing Privacy Policy.<br />\r\n<strong>Legal Requests</strong><br />\r\nWe cooperate with law enforcement and regulatory inquiries, as well as other third parties to enforce laws, such as: intellectual property rights, fraud and other rights, to help protect you and the community from bad actors. Therefore, in response to a verified request by law enforcement or other government officials relating to a criminal investigation or alleged illegal activity, we may (and you authorize us to) disclose some of your personal information as is reasonably necessary to respond to subpoenas, court orders, or other legal process. We may disclose personal information to law enforcement offices, third party rights owners, or others in the good faith belief that such disclosure is reasonably necessary to: enforce our Terms or Privacy Policy; respond to claims that an advertisement, posting or other content violates the rights of a third party; or protect the rights, property or personal safety of our users or the general public.<br />\r\n<strong>Your use of other users&#39; information</strong><br />\r\nIn order to facilitate interaction among all Shopking24.com members (buyers, sellers, services providers such as payment gateway and 3PLs, our Site allows you to access other users&#39; contact information. Further, as a seller you will be sent via email the Shopking24.com registered user ID email address and other information, and as a winning buyer you will be sent via email the Shopking24.com registered user ID email address and other information of the seller. By entering into our User Agreement, you agree that, with respect to other user&#39;s personally identifiable information that you obtain through the Site or through a Shopking24.com-related communication or Shopking24-facilitated transaction, Shopking24.com hereby grants to you a license to use such information only for:<br />\r\n(a). Shopking24.-related communications that are not unsolicited commercial messages, (b). using co-branded services offered through Shopking24.com (e.g. insurance, shipping and fraud complaints), and (c). any other purpose that such user expressly opts into after adequate disclosure of the purpose(s).<br />\r\nIn all cases, you must give users an opportunity to remove themselves from your database and a chance to review what information you have collected about them. In addition, under no circumstances, except as defined in this Section, can you disclose personally identifiable information about another user to any third party without our consent and the consent of such other user after adequate disclosure.<br />\r\nShopking24.com and our users do not tolerate spam. Therefore, without limiting the foregoing, you are not licensed to add a Shopking24.com user-even a user who has purchased an item from you-to your mail list (email or physical mail) without their express consent after adequate disclosure.</p>\r\n\r\n<p><span style="font-size:16px"><strong>What about children&#39;s privacy?</strong></span></p>\r\n\r\n<p>Use of Shopking24.com is available only to persons who can form a legally binding contract under the Indian Contract Act, 1872. If you are under the age of 18, you cannot buy or sell any items on the Site. If you wish to purchase or sell an item on the Site such purchase or sale may be made by your legal guardian or parents who have registered as users of the Site.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Access or change your personally identifiable information</strong></span></p>\r\n\r\n<p>To protect your privacy and security, we will verify your identity before granting access or making changes to your personally identifying information. If you have registered your profile on Shopking24.com, your registered user ID and Password are required in order to access your profile information.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Security</strong></span></p>\r\n\r\n<p>When you place orders or access your account information, we offer the use of a secure server. The secure server software (SSL) encrypts all information you put in before it is sent to us. Once your information is in our possession we adhere to strict security guidelines in compliance with the (Indian) Information Technology Act, 2000, protecting it against unauthorized access.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Your Consent</strong></span></p>\r\n\r\n<p>By using the Site and/ or by providing your information, you acknowledge our use of your personal information in the manner as set out in this Privacy Policy. Any changes to our privacy policy will be communicated through our Web site at least 10 days in advance of implementation. Name and address of the entity collecting and retaining your information shall be the contracting entity stated in the Shopking24.com User Agreement.</p>\r\n\r\n<p><span style="font-size:16px"><strong>Grievance Officer:</strong></span></p>\r\n\r\n<p>In accordance with Information Technology Act 2000 and rules made there under, the name and contact details of the Grievance Officer are published on the Site in User Agreement.</p>\r\n\r\n<p>&nbsp;</p>\r\n');
INSERT INTO `pages` (`page_id`, `title`, `name`, `url`, `content`) VALUES
(13, 'Seller Agreement', 'seller-agreement', 'http://localhost/flipkart/seller/seller-agreement', '<p>&nbsp;</p>\r\n\r\n<p style="text-align: center;"><span style="font-size:20px"><strong>Shopking24 User Agreement</strong></span></p>\r\n\r\n<p><br />\r\n<strong>This document is an electronic record in terms of Information Technology Act, 2000 and rules made there under as applicable and the amended provisions pertaining to electronic records in various statutes as amended by the Information Technology Act, 2000. This electronic record is generated by a computer system and does not require any physical or digital signatures.</strong><br />\r\n<strong><strong>This document is published in accordance with the provisions of Rule 3 (1) of the Information Technology (Intermediaries guidelines) Rules, 2011 that require publishing the rules and regulations, privacy policy and user agreement for access or usage of www.Shopking24.com website.</strong></strong></p>\r\n\r\n<p>Your use of a Shopking24 website {including www.Shopking24.com (hereinafter referred to as the &ldquo;Website&quot;) and its related sites, services and tools} is governed by the terms and conditions as contained in this Agreement applicable to the Website and for other websites of Shopking24 Private Limited and our subsidiaries and international affiliates. This User Agreement for the Website shall come into effect on 00:00 hours India Standard Time 26th September, 2011 (&quot;User Agreement&quot;). Shopking24.com is an internet based portal owned and operated by Shopking24 Private Limited; a company incorporated under Companies Act, 1956 having its registered office at Shopking24 Pvt. Ltd, Building No. 112, Sector 44, Gurgaon, 122 001, Haryana, India.<br />\r\nFor the purpose of this User Agreement, Registered User / Guest User and wherever the context so require &#39;&ldquo;you&rdquo;, &ldquo;your&rdquo; shall mean any natural or legal person who is accessing the Website, its contents and using the services offered on or through the Website and has agreed to become a member of the Website by providing Registration Data (as defined hereinafter) while registering on the Website as Registered User / Guest User using the computer systems of the Website and accepted this electronic version / electronic record of the User Agreement and has allocated himself/herself a unique identification user name (&quot;User ID&quot; and &quot;Password&quot;) to become Registered User or have been identified as Guest User by providing phone number and email id. Further, reference to &ldquo;we&rdquo;, &ldquo;us&rdquo;, &ldquo;our&rdquo; and &ldquo;Shopking24&rdquo; shall mean Shopking24 Private Limited (Shopking24.com) and includes its associates, affiliates and subsidiary (ies).<br />\r\nThe use of the Website is offered to you conditioned on your &lsquo;Acceptance&rsquo; of all the terms, conditions and notices contained in this User Agreement. Upon &ldquo;Acceptance&rdquo;, this User Agreement shall be effective and binding upon you along with any amendments made by Shopking24 at its sole discretion and posted on the Website and you shall not claim invalidity of this User Agreement merely on the grounds that this MOU is being concluded electronically. For the aforesaid purposes, &#39;Acceptance&#39; shall mean your affirmative action in clicking on &#39;check box&#39; and on the &#39;continue button&#39; as provided on the registration page or clicking on &#39;Buy Now&#39; button while transacting as Guest User or any act which reflects your use of the Website or the services provided by the Website or any such other actions that implies your acceptance You hereby further agree that this User Agreement is being concluded and executed at Gurgaon.&nbsp;<br />\r\nYour use of the Website implies that you agree with the terms of the User Agreement. If you do not agree or are not willing to be bound by the terms and conditions of this User Agreement and Rules and Policies as displayed on the Website, please do not click on the &quot;check box &quot; and/or on the &quot;continue&quot; button and/or &quot;Buy Now&quot; button and do not seek to obtain access to or otherwise use the Website.&nbsp;</p>\r\n\r\n<p><strong>Amendments:</strong></p>\r\n\r\n<p>When you use any of the services provided by us through the Website, including but not limited to Product Reviews, Seller Reviews etc., you will be subject to the rules, guidelines, policies, terms, and conditions applicable to such service, and they shall be deemed to be incorporated into this User Agreement and shall be considered as part and parcel of this User Agreement. We reserve the right, at our sole discretion, to change, modify, add or remove portions of the User Agreement, at any time without any prior written notice to you. It is your responsibility to review this User Agreement periodically for updates / changes. Your continued use of the Website following the posting of changes will mean that you accept and agree to the revisions. As long as you comply with the provisions of this Agreement,, we grant you a personal, non-exclusive, non-transferable, limited privilege to enter and use the Website.&nbsp;</p>\r\n\r\n<p>By accepting this User Agreement, you also accept and agree to be bound by Shopking24.com Rules and Policies as provided from time to time in the following hyperlinks:&nbsp;</p>\r\n\r\n<p><strong>1. Shopking24.com Policies &amp; Rules.</strong></p>\r\n\r\n<p><strong>2. Shopking24.com Privacy Policy.</strong></p>\r\n\r\n<p>Please note: various underlined words and phrases are hyperlinked to various rules and policies on the Website. By accepting this User Agreement, you also agree with the user agreement, privacy policy and other rules and policies posted on the websites of different countries where users belong to respectively.&nbsp;</p>\r\n\r\n<p><strong>1. Membership Eligibility</strong></p>\r\n\r\n<p>Use of the Website is available only to persons who can form legally binding contracts under Indian Contract Act, 1872. Persons who are &quot;incompetent to contract&quot; within the meaning of the Indian Contract Act, 1872 including minors, un-discharged insolvents etc. are not eligible to use the Website. If you are a minor i.e. under the age of 18 years, you shall not register as a member of the Website and shall not sell, purchase or bid for any items on the Website except through your legal guardian or parents who have registered as users on the Website or can use the Website as Guest User. Shopking24.com reserves the right to terminate your membership and refuse to provide you with access to the Website if it is brought to our notice or if it is discovered that you are under the age of 18 years.&nbsp;</p>\r\n\r\n<p>Business entity registration: If you are registering as a business entity, you represent that you are duly authorized to accept this User Agreement and you have the authority to bind your business entity to this User Agreement.&nbsp;</p>\r\n\r\n<p>Guest User: If you are transacting as a Guest User, you shall not be allowed to list/ sell product or services on Website and there could be certain additional restrictions on you as a Guest User for your purchase and the other functionality of the Website available to you. As a guest user, buyer will not be eligible for Shopking24 Bucks and all other benefits that are not assignable to a non-registered user.&nbsp;</p>\r\n\r\n<p><strong>2. Your Account and Registration Obligations</strong></p>\r\n\r\n<p>If you use the Website as Registered User, you are responsible for maintaining the confidentiality of your User ID and Password. If you use the Website as a Guest User you are responsible for maintaining the confidentiality of your email ID and phone number and restricting access to your computer, computer system and computer network. You are responsible for all activities that occur under your User ID and Password (if registered) or email id and phone number (if Guest User) as the case may be. Also as a Guest User, you shall ensure the physical security and possession of your phone, the details of which are used to transact services with Shopking24.com. You agree, inter alia, to: (i) Provide true, accurate, current and complete information about yourself as prompted by Shopking24.com&#39;s registration form or provided by you as Guest User (such information being the &quot;Registration Data&quot;) (ii) You must not include any of your contact details such as email addresses etc in your User ID while registering as Registered User; and (iii)Maintain and promptly update the Registration Data to keep it true, accurate, current and complete at all times; (iv) You must immediately notify us of any unauthorized use of your password or account or any other breach of security, and (v) ensure that you exit from your account at the end of each session. If you provide any information that is untrue, inaccurate, not current or incomplete or Shopking24.com has reasonable grounds to suspect that such information is untrue, inaccurate, not current or incomplete, or not in accordance with the User Agreement, Shopking24.com has the right to indefinitely suspend or terminate or block access of your membership with the Website and refuse to provide you with access to the Website. Shopking24.com shall not be liable for any loss or damage arising from your failure to comply with this Clause 2. 3. Electronic Execution and Communications When you use the Website or send emails or other data, information or communication to Shopking24.com, you agree and understand that you are communicating with Shopking24.com through electronic records. You consent to receive communications from us electronically. We will communicate with you by email or by posting notices on the Website or through any other Shopking24 services. You agree that all the agreements, notices, disclosures and other communications that we provide to you electronically shall be deemed adequate service of notice/electronic record and satisfy any legal requirement that such communication be in writing.</p>\r\n\r\n<p><strong>3. Electronic Execution and Communications</strong></p>\r\n\r\n<p>Membership on the Website is free. Shopking24.com does not charge any fee for browsing and buying on the Website. However, before you list an item for sale through the Website, we request you to review our Fees and Credit Policy, which is hereby incorporated by reference into this agreement. Shopking24.com reserves the right to change its Service Fee and Credit policies from time to time at its sole discretion including without limitation right to introduce fees for the new services offered or amend/introduce fees for existing services, as the case may be. Any modifications to the Fee and Credit policies shall be posted on the Website and such changes shall become effective immediately. Unless otherwise stated, all fees shall be quoted in Indian Rupees and be payable to Shopking24 Private Limited within such time as specified in the invoice.&nbsp;</p>\r\n\r\n<p><strong>4. Fees and Services</strong></p>\r\n\r\n<p>Membership on the Website is free. Shopking24.com does not charge any fee for browsing and buying on the Website. However, before you list an item for sale through the Website, we request you to review our Fees and Credit Policy, which is hereby incorporated by reference into this agreement. Shopking24.com reserves the right to change its Service Fee and Credit policies from time to time at its sole discretion including without limitation right to introduce fees for the new services offered or amend/introduce fees for existing services, as the case may be. Any modifications to the Fee and Credit policies shall be posted on the Website and such changes shall become effective immediately. Unless otherwise stated, all fees shall be quoted in Indian Rupees and be payable to Shopking24 Private Limited within such time as specified in the invoice.&nbsp;</p>\r\n\r\n<p>4.1. 4.1. How fee is charged and payment schedule. We process online payments on behalf of merchants and send the money to merchant after deducting our service fees. Merchants do not have to deal with online payments as we take care of it. The merchants need to provide certain banking and accounting information to set-up online bank transfer account. We have a weekly payment cycle. Every Friday, the money (i.e. order final value minus our service fees) pertaining to all orders completed two weeks prior to the relevant Friday will be electronically transferred to your mentioned bank account.&nbsp;</p>\r\n\r\n<p>4.2. Taxes:You are responsible for paying all fees associated with the use of the Website and you agree to bear any and all applicable taxes, charges, cesses etc. levied thereon.&nbsp;</p>\r\n\r\n<p>4.3. Non-payment: Shopking24.com reserves the right to issue a warning, temporarily /indefinitely suspend or terminate your membership of the Website and refuse to provide you with access to all current and future use of the Website in case of non-payment of fees by you to Shopking24.com. Shopking24.com also reserves the right to take legal action in case of non- payment of fees.&nbsp;</p>\r\n\r\n<p><strong>5. Use of the Website</strong></p>\r\n\r\n<p>5.1. 5.1. You understand and agree that Shopking24 and the Website merely provides hosting services to its Registered Users and persons browsing / visiting the Website. All items advertised / listed and the contents therein are advertised and listed by Registered Users and are third party user generated contents. Shopking24.com neither originates nor initiates the transmission nor selects the sender and receiver of the transmission nor selects nor modifies the information contained in the transmission. Shopking24.com has no control over the third party user generated contents and does not provide any guarantee with respect to any such content and Shopking24 shall not be held liable for any loss suffered by you based on your reliance on or use of such data/content.&nbsp;</p>\r\n\r\n<p>5.2. You agree, undertake and confirm that your use of the Website shall be strictly governed by the following binding principles:&nbsp;</p>\r\n\r\n<p>5.2.1. 5.2.1. &ldquo;Your Information&rdquo; is defined as any information you provide to us or other users of the Website (&quot;Users&quot;) in the registration (as Registered User or as Guest User), buying or listing process, in the feedback area or through any e-mail feature. You are solely responsible for Your Information, and we act only as a passive conduit for your online distribution and publication of Your Information.&nbsp;</p>\r\n\r\n<p>5.2.2. Your Information (or any items listed):&nbsp;</p>\r\n\r\n<p>Please note that in accordance with the Information Technology (Intermediaries guidelines) Rules 2011, in case of non-compliance with rules and regulations, user agreement and privacy policy, for access or usage of intermediary computer resource, the Intermediary has the right to immediately terminate the access or usage rights of the users to the computer resource of Intermediary and remove non-compliant information.&nbsp;</p>\r\n\r\n<p>5.2.3. In terms of Information Technology (Intermediaries Guidelines) Rules, 2011 you agree and undertake that you shall not host, display, upload, modify, publish, transmit, update or share any information or share/list(s) any information or item that:&nbsp;</p>\r\n\r\n<p><br />\r\n(a). belongs to another person and to which You do not have any right;&nbsp;</p>\r\n\r\n<p>(b). is grossly harmful, harassing, blasphemous, defamatory, obscene, pornographic, paedophilic, libellous, invasive of another&#39;s privacy, hateful, or racially, ethnically objectionable, disparaging, relating or encouraging money laundering or gambling, or otherwise unlawful in any manner whatever; or unlawfully threatening or unlawfully harassing including but not limited to &quot;indecent representation of women&quot; within the meaning of the Indecent Representation of Women (Prohibition) Act, 1986;&nbsp;</p>\r\n\r\n<p>(c). harm minors in any way;&nbsp;</p>\r\n\r\n<p>(d). infringes any patent, trademark, copyright or other proprietary rights or third party&#39;s trade secrets or rights of publicity or privacy or shall not be fraudulent or involve the sale of counterfeit or stolen items;&nbsp;</p>\r\n\r\n<p>(e). involves the transmission of &quot;junk mail&quot;, &quot;chain letters&quot;, or unsolicited mass mailing or &quot;spamming&quot;;&nbsp;</p>\r\n\r\n<p>(f). violates any law for the time being in force;&nbsp;</p>\r\n\r\n<p>(g). deceives or misleads the addressee/ users about the origin of such messages or communicates any information which is grossly offensive or menacing in nature;&nbsp;</p>\r\n\r\n<p>(h). impersonate another person;&nbsp;</p>\r\n\r\n<p>(i). contains software viruses or any other computer code, files or programs designed to interrupt, destroy or limit the functionality of any computer resource; or contains any Trojan horses, worms, time bombs, cancelbots, easter eggs or other computer programming routines that may damage, detrimentally interfere with, diminish value of, surreptitiously intercept or expropriate any system, data or personal information;&nbsp;</p>\r\n\r\n<p>(j). threatens the unity, integrity, defense, security or sovereignty of India, friendly relations with foreign states, or public order or causes incitement to the commission of any cognizable offence or prevents investigation of any offence or is insulting any other nation.&nbsp;</p>\r\n\r\n<p>(k). shall not be false, inaccurate or misleading;&nbsp;</p>\r\n\r\n<p>(l). shall not, directly or indirectly, offer, attempt to offer, trade or attempt to trade in any item, the dealing of which is prohibited or restricted in any manner under the provisions of any applicable law, rule, regulation or guideline for the time being in force. Without prejudice to the generality of the above, Shopking24.com does not permit transactions in the following items including but not limited to categories as stated in the Prohibited and Restricted Items Policy which can be accessed at http://Shopking24.com/policies-and-rules.html shall not create liability for us or cause us to lose (in whole or in part) the services of our ISPs or other suppliers; and&nbsp;</p>\r\n\r\n<p>(m). shall not link directly or indirectly to or include descriptions of items, goods or services that are prohibited under the User Agreement or any other applicable law for the time being in force including but not limited to the Drugs and Cosmetics Act, 1940, the Drugs And Magic Remedies (Objectionable Advertisements) Act, 1954, the Indian Penal Code, 1860, Information Technology Act 2000 as amended time to time and rules there under;&nbsp;</p>\r\n\r\n<p>(n). are identical to other items you have up for auction but are priced lower than your item&#39;s price, the reserve price of the item or minimum bid amount; are concurrently listed for sale on a web site other than the Website;&nbsp;</p>\r\n\r\n<p><br />\r\n5.2.4. Shopking24.com shall have the right to use Your Information as provided by you and such usage of your information by us does not amount to violation of any rights you might have in Your Information. You agree to grant us a non-exclusive, worldwide, perpetual, irrevocable, royalty-free, sub-licensable (through multiple tiers) right to exercise the copyright, publicity, and database rights (but no other rights) you have in Your Information, in any media now known or not currently known, with respect to Your Information. Shopking24.com will only use Your Information in accordance with the User Agreement and Shopking24.com&#39;s Privacy Policy.&nbsp;</p>\r\n\r\n<p>5.2.5. You represent and confirm that you shall be the sole and exclusive legal owner of all items, goods or products of any description that you wish to offer for sale on the Website. You shall have absolute right, title and authority to deal in and offer for sale such items, goods or products.&nbsp;</p>\r\n\r\n<p>5.2.6. In the event that any transaction or attempted transaction relating to any item, good or service which is in violation of this User Agreement or applicable law comes to your knowledge, you shall take all steps to inform Shopking24.com of the same at info@Shopking24.com.&nbsp;</p>\r\n\r\n<p>5.2.7. You shall at all times ensure full compliance with the applicable provisions of the Information Technology Act, 2000 and rules made there under as applicable and as amended from time to time and also all applicable Domestic laws, rules and regulations (including the provisions of any applicable Exchange Control Laws or Regulations in Force) and International Laws, Foreign Exchange Laws, Statutes, Ordinances and Regulations (including, but not limited to Sales Tax/ VAT, Income Tax, Octroi, Service Tax, Central Excise, Custom Duty, Local Levies) regarding your use of our service and your bidding on, listing, purchase, solicitation of offers to purchase, and sale of items or services. You shall not engage in any transaction in an item or service, which is prohibited by the provisions of any applicable law including exchange control laws or regulations for the time being in force. In particular you shall ensure that if any of your items listed on the Website qualifies as an &quot;Antiquity&quot; or &quot;Art treasure&quot; as defined in the Antiquities and Art Treasures Act, 1972 (&quot;Artwork&quot;), you shall indicate that such Artwork is &quot;non-exportable&quot; and sold subject to the provisions of said the Act, and shall ensure that it is not delivered to buyer (as defined under the Buying section) at any place outside India.&nbsp;<br />\r\n5.2.8. You shall not, either alone or in conjunction with other Users, manipulate or attempt to manipulate the prices of any item or services being sold or purchased on the Website.&nbsp;</p>\r\n\r\n<p>5.2.9. From time to time, you shall be responsible for providing information relating to the items or services proposed to be sold by you. In this connection, you undertake that all such information shall be accurate in all respects. You shall not exaggerate or over emphasize the attributes of such items or services so as to mislead other Users in any manner. It is possible that other users (including unauthorized users or &quot;hackers&quot;) may post or transmit offensive or obscene materials on the Website and that You may be involuntarily exposed to such offensive and obscene materials. It also is possible for others to obtain personal information about You due to your use of the Website, and that the recipient may use such information to harass or injure You. We does not approve of such unauthorized uses, but by using the Website You acknowledge and agree that We are not responsible for the use of any personal information that You publicly disclose or share with others on the Website. Please carefully select the type of information that You publicly disclose or share with others on the Website.&nbsp;</p>\r\n\r\n<p>5.2.10. You shall not attempt to or circumvent or manipulate our Fee structure, the billing process or Fees owed to Shopking24.com as detailed and agreed in MOU signed by merchants/sellers.&nbsp;</p>\r\n\r\n<p><strong>6. Platform for Communication</strong></p>\r\n\r\n<p>The Website is only a venue where Users may meet and interact with one another for their transactions. Shopking24.com is not and cannot be a party to or control in any manner any transaction between two Users of the Website. Consequently:&nbsp;</p>\r\n\r\n<p>6.1. All commercial / contractual terms are offered by and agreed to between buyers and sellers alone. The commercial / contractual terms include without limitation price, shipping costs, payment methods, payment terms, date, period and mode of delivery, warranties and after sales services related to goods and services. Shopking24.com does not have any control or determines or advises or in any way involves itself in the offering or acceptance of such commercial / contractual terms between buyers and sellers.&nbsp;</p>\r\n\r\n<p>6.2. Shopking24.com is not responsible for any non-performance or breach of any contract entered into between Users (includes Registered User or Guest User). Shopking24.com cannot and does not guarantee that the concerned Users will perform any transaction concluded on the Website. Shopking24.com shall not and is not required to mediate or resolve any dispute or disagreement between Users.&nbsp;</p>\r\n\r\n<p>6.3. Shopking24.com does not make any representation or warranty as to the attributes (such as quality, worth, marketability, etc.) of the items or services proposed to be sold or offered to be sold or purchased on the Website. In particular, Shopking24.com does not implicitly or explicitly support or endorse the sale or purchase of any items or services on the Website. Shopking24.com accepts no liability for any errors or omissions, whether on behalf of itself or third parties.&nbsp;</p>\r\n\r\n<p>6.4. Shopking24.com does not make any representation or warranty as to the attributes (such as legal title, creditworthiness, identity, etc.) of any of its Users. You are advised to independently verify the bona fides of any particular User that you choose to deal with on the Website and use your best judgment in that behalf.&nbsp;</p>\r\n\r\n<p>6.5. Shopking24.com does not at any point of time during any transaction between buyer and seller on Website come into or takes of any of the goods or services offered by seller nor does it at any point gain title to or have any rights or claims over the goods or services offered by seller to buyer. Shopking24 may provide fulfillment and logistics services to certain merchants/sellers but still does not take possession or title of any product or service sold.&nbsp;</p>\r\n\r\n<p>6.6. The Website is only a venue through which Users can reach a larger base to buy and sell items or services. Shopking24.com is only providing a platform for communication and it is agreed that the contract for sale of any of the products or services shall be a strictly bipartite contract between the Seller and the buyer. At no time shall any right, title or interest over the items vest with Shopking24.com nor shall Shopking24.com have any obligations or liabilities in respect of such contract. Shopking24.com is not responsible for unsatisfactory or delayed performance of services or damages or delays as a result of items, which are out of stock, back ordered or otherwise unavailable. All items are offered only for a restricted time and only for the available supply.&nbsp;</p>\r\n\r\n<p>6.7. At no time shall any right, title or interest over the items vest with Shopking24.com nor shall Shopking24.com have any obligations or liabilities in respect of such contract. Shopking24.com is not responsible for unsatisfactory or delayed performance of services or damages or delays as a result of items which are out of stock, back ordered or otherwise unavailable. All items are offered by sellers are only for a restricted time and only for the available supply as offered by sellers.&nbsp;</p>\r\n\r\n<p>6.8. You shall independently agree upon the manner and terms and conditions of delivery, payment, insurance etc. with the other Users that you transact with.&nbsp;</p>\r\n\r\n<p>6.9. You release and indemnify Shopking24.com and/or any of its shareholders, directors, officers, employees and representatives from any cost, damage, liability or other consequence of any of the actions of the Users of the Website and specifically waive any claims that you may have in this behalf under any applicable law. Notwithstanding its reasonable efforts in that behalf, Shopking24.com cannot control the information provided by other Users which is made available on the Website. You may find other User&#39;s information to be offensive, harmful, inaccurate, or deceptive. Please use caution and practice safe trading when using the Website. Please note that there may be risks in dealing with foreign nationals, underage persons or people acting under false pretense.&nbsp;</p>\r\n\r\n<p>Disclaimer: You acknowledge and undertake that you are accessing the services on the Website and transacting at your own risk and are using your best and prudent judgment before entering into any transactions through the Website. We shall neither be liable nor responsible for any actions or inactions of sellers nor any breach of conditions, representations or warranties by the sellers or manufacturers of the products and hereby expressly disclaim any and all responsibility and liability in that regard.&nbsp;</p>\r\n\r\n<p><strong>7. Privacy</strong></p>\r\n\r\n<p>We do not sell or rent your personal information to third parties for their marketing purposes without your explicit consent and we only use your information as described in the Privacy Policy. We view protection of users&#39; privacy as a very important community principle. We understand clearly that you and Your Personal Information is one of our most important assets. We store and process Your Information on computers located in the United States and Asia Pacific at some of the best data centers in the world that are protected by physical as well as reasonable technological security measures and procedures in accordance with Information Technology Act 2000 and rules there under. Our current Privacy Policy is available at http://Shopking24.com/privacy-policy.html. If you object to your Information being transferred or used in this way please do not use the Website.&nbsp;</p>\r\n\r\n<p>Your Consent: By using the Site and/ or by providing Your Information, you consent to the collection and use of the information you disclose on the Site by Shopking24.com in accordance with Shopking24.com Privacy Policy. You agree and acknowledge that you have read and fully understood the Privacy Policy and the terms and contents of such Privacy Policy as mentioned in the Website is acceptable to you.&nbsp;</p>\r\n\r\n<p><strong>8. Breach</strong></p>\r\n\r\n<p>Without limiting other remedies, Shopking24.com may limit your activity, immediately remove your information or end your listing, warn other Users of your actions, temporarily/indefinitely suspend or terminate or block your membership, and/or refuse to provide you with access to the Website in the event, but not limited to:&nbsp;</p>\r\n\r\n<p>a) If you breach the User Agreement or Privacy Policy or the documents, agreements rules, policies, terms and conditions as incorporated herein by reference;&nbsp;</p>\r\n\r\n<p>b) If Shopking24.com is unable to verify or authenticate any information provided by you; or&nbsp;</p>\r\n\r\n<p>c) If it is believed that your actions may cause legal liability for other Users or Shopking24.com. We may at any time at our sole discretion reinstate suspended Users. A User that has been suspended or blocked may not register or attempt to register with Shopking24.com or use the Website in any manner whatsoever until such time that such User is reinstated by Shopking24.com. Notwithstanding the foregoing, if you breach the User Agreement or any other documents it incorporates by reference, Shopking24.com reserves the right to recover any amounts due and owing by you to Shopking24.com and to take strict legal action including but not limited to a referral to the appropriate police or other authorities for initiating criminal or other proceedings against you.&nbsp;</p>\r\n\r\n<p><strong>9. Buying</strong></p>\r\n\r\n<p>All purchases on the Website are a firm commitment to purchase. If you are the purchaser for any item, you are obligated to complete the transaction with the seller.&nbsp;</p>\r\n\r\n<p>By purchasing on an item you agree to be bound by the conditions of sale included in the item&#39;s description (or linked to from the description) so long as those conditions of sale are not in violation of the User Agreement or unlawful. In case of consumer goods, sellers on the Website may or may not specify the retail prices of the items being sold. You are advised to independently verify the retail prices of such items if you so desire.&nbsp;</p>\r\n\r\n<p>Shopking24.com strongly advises you not to test the site with false purchases, as it will put you at substantial personal legal risk. It is an offence to use a false name, other false personal information or a known invalid/ unauthorized credit/ debit/ cash card and such other infrastructure directly through Bank or financial institution infrastructure or indirectly through Payment Aggregator. Willfully entering erroneous or fictitious bids may result in prosecution by Shopking24.com.&nbsp;</p>\r\n\r\n<p>Please note that in the event any inaccurate information is provided by you regarding your identity, your Web browser transmits a unique address to us, which can be used by law enforcement officials to identify you. If you are a registered buyer on the Website we encourage you to post feedback on the seller after the transaction is closed.&nbsp;</p>\r\n\r\n<p>In case of purchase of an Artwork which is marked as &quot;non-exportable&quot; on the Website or it is illegal to export the same, you agree that the Artwork shall not be exported out of India or otherwise dealt in any such manner which shall be in contravention of any law for the time being in force or any rules, regulations, notifications and orders passed there under.&nbsp;</p>\r\n\r\n<p><strong>10. Fulfillments and Shipping</strong></p>\r\n\r\n<p>Shopking24.com from time to time may offer certain fulfillment services to sellers, however, sellers remain responsible for the overall shipping quality, delivery, and cost of shipping. Shopking24.com may provide pick-up, storage, and delivery services to sellers but all of these services are provided as contract or outsourced services on behalf of merchants. At no time, Shopking24.com takes title or ownership of any product or inventory.&nbsp;</p>\r\n\r\n<p><strong>11. Buyer Protection at Shopking24.com</strong></p>\r\n\r\n<p>All the merchants selling at Shopking24.com are well screened by our team before they are brought on board. Shopking24 endeavors to ensure that the products you buy from our Website are genuine, authentic, products and are sold by well reputed and honorable merchants at the best prices possible. We also extend all the warranties, guarantees as entailed in the product by the seller to you, all this at a great price and with the best customer service in the industry. It is however clarified that the Shopking24 seeks to ensure the aforesaid only on a best endeavor basis and does not assure or provide any personal warranties or assumes and liability or responsibility pertaining to the genuinity and authenticity of the products and/or the seller, for which the seller shall be solely responsible and liable.&nbsp;</p>\r\n\r\n<p>As per our replacement policy, if you receive a product which is not as per the specifications ordered by you - (i) wrong size, (ii) wrong color, (iii) defective or (iv) significantly different from the description given by the merchant and you intimate such shortcoming to us in writing within 24 hours of receiving the product, such an can be replaced or if such product is not available for replacement your money will be refunded, within 10 days of such intimation received. However do make sure that the merchandise has not been used/worn or altered and is accompanied by its original price tag and packing slip. Please contact our customer support, so we can help facilitate your return.&nbsp;</p>\r\n\r\n<p>If Shopking24.com has suspicion or knowledge, that any of its members are involved in any activity that is intended to provide claims or information that is false, misleading or not genuine, then Shopking24.com may while reserving its rights to initiate civil and/or criminal proceedings against member may also at its sole discretion suspend, block, restrict, cancel the user id of Registered User and such necessary action against Guest User of such member and/or disqualify that member and any related members from availing protection through this program.&nbsp;</p>\r\n\r\n<p>Shopking24.com reserves its right to initiate civil and/or criminal proceedings against a user who, files an invalid and/or false claim or provides false, incomplete, or misleading information. In addition to the legal proceedings as aforesaid, Shopking24.com may at its sole discretion suspend, block, restrict, cancel the user id [and its related user ids] of such user and/or disqualify that member and any related members from availing protection through this program.&nbsp;<br />\r\nAny person who, knowingly and with an intent to injure, defraud or deceive, files a Fraudulent Complaint containing false, incomplete, or misleading information shall be guilty of a criminal offence and will be prosecuted to the fullest extent of the law.&nbsp;</p>\r\n\r\n<p><strong>12. Selling/Advertising</strong></p>\r\n\r\n<p>As a registered member, you may list item/s for sale/advertising on the Website in accordance with the Listing Policies more fully detailed at Shopking24.com Rules and Policies http://Shopking24.com/policies-and-rules.html which Policy is incorporated by way of reference in this Agreement.&nbsp;<br />\r\nYou represent that you are legally allowed to sell/advertise the item(s) you list for sale/advertising on Shopking24.com. You further agree to ensure that the products sold/advertised by you through Shopking24.com are genuine and are not counterfeit or stolen items. You further agree to ensure that the items/products listed by you on Shopking24.com do not infringe upon the intellectual property, trade secret or other proprietary rights or rights of publicity or privacy rights of any third parties.&nbsp;</p>\r\n\r\n<p>You acknowledge and understand that &quot;Listings&quot; may include text descriptions, graphics and pictures that describe your item for sale. You shall be deemed to be infringing the intellectual property rights of a third party if you are (i) affixing a registered trademark (or an identical or similar trademark likely to confuse the public to have an association with the registered trademark) of such third party to your goods or its packaging; (ii) offering or putting for sale or stocking the goods under the said trademark; or (iii) using the said trademark in advertising your product.&nbsp;</p>\r\n\r\n<p>You acknowledge that if any genuine claim is received by Shopking24 from any person through the Report Abuse section of Shopking24.com (terms of which are incorporated herein by reference), Shopking24 may in its sole discretion block your merchant/user account and/or remove the products listed by you on Shopking24.com, without any prior notice to you. Shopking24 would however provide you a post facto intimation regarding the same. You agree that you shall have no claim whatsoever against Shopking24 in this regard and the decision of Shopking24, as aforesaid shall be binding on you.&nbsp;</p>\r\n\r\n<p>You further agree to ensure that the listing description of the item must not be misleading and must describe actual condition of the product. All listed items must be listed in an appropriate category on the Website. All listed items must be kept in stock for successful fulfillment of sales. If the item description does not match the actual condition of the item, you agree to replace the product delivered to the buyer with the correct product and/or refund any amounts that you may have received from the buyer within 10 days of receipt of intimation from us in this regard. You agree not to list a single product in multiple quantities across various categories on the site. Shopking24.com reserves the right to delete such multiple listings of the same product listed by you in various categories.&nbsp;</p>\r\n\r\n<p><strong>13. Payments</strong></p>\r\n\r\n<p>Shopking24.com uses third party payment providers to receive payments from buyers on seller&#39;s behalf. Shopking24.com is not responsible for delays or erroneous transaction execution or cancellation of orders due to payment issues. Shopking24.com takes utmost care to work with 3rd party payment providers, but does not control their systems, processes, technology and work flows, hence cannot be held responsible for any fault at the end of payment providers. Further, Shopking24.com does not release the payment to sellers until the order has been received by Buyers and they are satisfied with it. Shopking24.com shall only make payments to the sellers after 4 weeks have expired from the time payment has been received from the buyer to us. The Seller payment is typically net of the service fee charged by Shopking24.com for its services and after deduction of applicable withholding taxes (if any).&nbsp;</p>\r\n\r\n<p><strong>14. Feedback</strong></p>\r\n\r\n<p>We encourage Registered buyers on the Website to provide feedback to sellers after the transaction has been closed, this helps other Users to know the performance level of the said merchant/seller.. Please remember that you cannot retract the feedback once you have provided it. Further you agree that the feedback you provide to the Website shall be deemed to be non- confidential and will be displayed along with your user ID. Shopking24.com will not be responsible for the feedback that you post on the Website and you should be careful in making comments that are not factual in nature and should not post defamatory or illegal or offensive/obscene contents, for which you shall alone be liable.&nbsp;</p>\r\n\r\n<p>You may not take any actions that may undermine the integrity of the feedback system. If you continue to receive negative feedback ratings, Shopking24.com reserves the right to suspend your membership, and you will be unable to list, buy or bid on the Website. Your agree that your feedback shall not contain confidential or proprietary information of you or of third parties.&nbsp;</p>\r\n\r\n<p>Export - As feedback ratings are not designed for any purpose other than for facilitating trading between the Users, you agree that you shall not market or export your Website feedback rating in any venue other than on the Website.&nbsp;</p>\r\n\r\n<p>Import - We do not provide the technical ability to allow you to import feedback from other websites to Shopking24.com because a composite number, without the corresponding feedback does not reflect your true online reputation within our community.&nbsp;</p>\r\n\r\n<p><strong>15. No Warranty</strong></p>\r\n\r\n<p>Shopking24.com and its suppliers, affiliates and service providers provide the Website and services &quot;as is&quot; and without any Warranty or condition, express, implied or statutory and specifically disclaim any implied Warranties of title, merchantability, fitness for a particular purpose and non-infringement. You expressly agree that your use of the Website is at your own risk.&nbsp;</p>\r\n\r\n<p><strong>16. Limitation of Liability</strong></p>\r\n\r\n<p>In no event shall Shopking24.com or its suppliers, affiliates and service providers be liable for any direct, indirect, incidental, special, incidental, consequential or exemplary damages, including but not limited to, damages for loss of profits, goodwill, use, data or other intangible losses arising out of or in connection with the Website, its services or this agreement (however arising, including negligence).&nbsp;</p>\r\n\r\n<p>Shopking24.com&#39;s liability in any circumstance is limited to the amount of fees, if any, paid by you to Shopking24.com. Shopking24.com, its associates, affiliates and service providers and technology partners make no representations or Warranties about the accuracy, reliability, completeness, and/or timeliness of any content, information, software, text, graphics, links or communications provided on or through the use of the Website or that the operation of the Website will be error free and/or uninterrupted. Consequently, Shopking24.com assumes no liability whatsoever for any monetary or other damage suffered by you on account of:&nbsp;</p>\r\n\r\n<p>(a) The delay, failure, interruption, or corruption of any data or other information transmitted in connection with use of the Website;&nbsp;</p>\r\n\r\n<p>(b) Any interruption or errors in the operation of the Website.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>17. Indemnity</strong></p>\r\n\r\n<p><br />\r\nYou agree to indemnify and hold harmless Shopking24.com and (as applicable) Shopking24.com&#39;s parent, subsidiaries, affiliates, third-parties and their respective shareholders, officers, directors, agents, and employees, from any losses, liabilities, damages, costs and expenses, claims or demand, or actions including reasonable attorneys&#39; fees asserted against or incurred by Shopking24.com, made by any third party arising out of your breach or non-performance of terms of the User Agreement, Shopking24.com Rules and Policies, or the documents they incorporate by reference, or your violation of any law, rules or regulations or the rights of a third party.&nbsp;</p>\r\n\r\n<p><strong>18. General</strong></p>\r\n\r\n<p>18.1. None of the provisions of the User Agreement shall be deemed to constitute a partnership or agency between you and Shopking24.com and you shall have no authority to bind Shopking24.com in any manner whatsoever.&nbsp;</p>\r\n\r\n<p>18.2. Notices: Except as explicitly stated otherwise, any notices shall be given by postal mail on behalf of Shopking24.com to Shopking24 Private Limited Attn: Legal Department, at Shop Shopking24 corporate office situated at 40A/5, 2nd Floor, Chander Nagar, Sector - 15 Part 2, Gurgaon - 122001 (in the case of Shopking24.com) or to the email address you provide to us during the registration process (in your case). Notice shall be deemed given 24 hours after email is sent, unless the sending party is notified that the email address is invalid. Alternatively, we may give you notice by certified mail, postage prepaid and return receipt requested, to the address provided to us during the registration process. In such case, notice shall be deemed given 3 days after the date of mailing.&nbsp;</p>\r\n\r\n<p>18.3. Severability: If any clause of the User Agreement shall be deemed invalid, void or for any reason unenforceable, such clause shall be deemed severable and shall not affect the validity and enforceability of the remaining clauses of the User Agreement.&nbsp;</p>\r\n\r\n<p>18.4. Entire Agreement: This Agreement sets forth the entire understanding and agreement between you and Shopking24.com with respect to the subject matter hereof.&nbsp;</p>\r\n\r\n<p>18.5. Assignment: You cannot assign or otherwise transfer this User Agreement, or any rights granted hereunder to any third party. Shopking24.com may transfer its rights and obligations (also known as &quot;assign&quot;) under this Agreement without your prior express consent, provided that Shopking24.com assigns the Agreement on the same terms or terms that are no less advantageous to you.&nbsp;</p>\r\n\r\n<p>18.6. Disputes Resolutions&nbsp;</p>\r\n\r\n<p>Generally, transactions are conducted smoothly on Shopking24.com. However there may be some cases where both the Buyers and Sellers may face issues. At Shopking24.com, we have a Dispute Resolution process in order to resolve disputes between Buyers and Sellers.&nbsp;</p>\r\n\r\n<p>A &#39;Dispute&#39; can be defined as a disagreement between a Buyer and a Seller in connection with a transaction on the Website. Disputes arise out of an issue that is raised by either party not being completely satisfied with the resolution of their complaint/issue.&nbsp;</p>\r\n\r\n<p>It is important that before a Buyer/Seller raises a dispute, they should attempt to resolve the issue amicably between each other. Please note that whenever a buyer raises a dispute, the seller&#39;s payment for that order is put on hold immediately until the issue is resolved.&nbsp;</p>\r\n\r\n<p><br />\r\nHow is a &#39;dispute&#39; resolved?</p>\r\n\r\n<p>Whenever there is a disagreement relating to any transaction, the users can write to grievance@Shopking24.com in order to raise a dispute. Once a dispute is raised by either party, Shopking24.com shall try to mediate and the resolve the matter amicably.&nbsp;</p>\r\n\r\n<p>18.7. Grievance Officer&nbsp;</p>\r\n\r\n<p>In accordance with Information Technology Act, 2000 and rules made there under, the name and contact details of the Grievance Officer is published herewith:&nbsp;</p>\r\n\r\n<p>Legal department<br />\r\nPlot No. 112, Sector &ndash; 44, Gurgoan - 122003<br />\r\nEmail: grievance@Shopking24.com.&nbsp;</p>\r\n\r\n<p><strong>19. Arbitration</strong></p>\r\n\r\n<p>If any dispute arises between you and Shopking24.com during your use of the Website or thereafter, in connection with the validity, interpretation, implementation or alleged breach of any provision of the User Agreement, or the documents they incorporate by reference, the dispute shall be referred to a sole Arbitrator who shall be an independent and neutral third party identified by Shopking24.com. The place of arbitration shall be New Delhi, India. The arbitration proceedings shall be in the English Language and shall be governed by Arbitration &amp; Conciliation Act, 1996.&nbsp;</p>\r\n\r\n<p><strong>20. Governing Law</strong></p>\r\n\r\n<p>The User Agreement or the documents they incorporates by reference shall be governed and construed in accordance with the laws of India. Subject to Clause 19 above, all disputes arising under this Agreement between you and Shopking24 shall be subject to the exclusive jurisdiction of courts at Gurgaon, India.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n'),
